(3, 'Dr.  Joseph Dubin , DDS', 'Orthodontist', '1c8ab47ea75acedd1d32c94d2041334cDr---Joseph-Dubin---DDS.png', '85 Raritan Ave , Highland Park , NJ  08904', 'Dr. Joseph Dubin entered dentistry as a second career. Dr. Joseph worked in the television industry for five years. Even though working in the media was exciting, he was not fulfilled and wanted to work with and help people.     He decided to follow in Dr. Brian’s footsteps, and after some additional coursework at Hunter College in New York, Dr. Joseph entered Columbia University College of Dental Medicine in 2004. While at Columbia, Dr. Joseph was involved in student government where he represented the entire dental school in the University-wide Senate. Upon graduation, he was awarded the New York Academy of Dentistry Exemplary Professional Conduct Award by the entire faculty.    Dr. Joseph received his Doctorate of Dental Surgery in 2008 and immediately entered New York University College of Dentistry’s Orthodontics and Dentofacial Orthopedics Program from where he received his Certificate in Orthodontics in 2010. Dr. Joseph was the Chief Resident in his senior year at NYU, was awarded the Invisalign® Leadership Award, and presented his research in Osteogenesis at the American Association of Orthodontists annual meeting in 2010.     He is trained in the most advanced techniques used in orthodontics today including temporary anchorage devices, soft tissue laser (Academy of Laser Dentistry certified), lingual orthodontics, self-ligation, Invisalign, and advanced digital imaging.    Dr. Joseph is married and met his wife at summer camp when they were teenagers. They live in New York City with their son. Dr. Joseph is a passionate sports fan (Mets, Giants, Knicks, Rangers, and Michigan Wolverines) and enjoys skiing, golf, tennis, and basketball.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-1