(4, 'Dr.  Shivani Dave , DMD', 'Orthodontist', '72d4e02871b70e5e1a2ca2e3754c9afeDr---Shivani-Dave---DMD.png', '65 Broadway , New York , NY  10006', '&quot;Their front desk is extremely disorganized. I was called multiple times to reschedule my appointment and then was even emailed after I *ATTENDED* the appointment and they claimed I never got back to them to reschedule. Then when I arrived for the appointment, I waited basically an hour to see the doctor. My appointment time apparently didn’t mean much and thank god I’d taken the rest of the day off work or my employers would’ve wondered what the heck happened. Very disorganized place. Once I saw the doctor she was fine, but the overall vibe was disorganized, not attentive and not helpful.&quot;<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>65 Broadway Dental</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - East Carolina University, Doctor of Dental Medicine</li><li>Columbia University, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Dental Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 3.67, '2022-09-15'),
(5, 'Dr.  Corey Goldstein , DMD', 'Orthodontist', 'cbd1f8c73eec0807335bc293088a103fDr---Corey-Goldstein---DMD.png', '15905 92nd St , Howard Beach , NY  11414', 'Sometimes orthodontics cannot “fix” a problem alone. Nature, genetics and environmental factors sometimes result in situations that require help from other dental specialists. Bone relationships can affect the function and esthetics of the teeth and jaws. Sometimes oral surgeons are needed to perform orthognathic surgery to move bones. Periodontists may be needed to correct gum problems or place implants where teeth are missing. General dentists may need to replace missing or broken down teeth. We work with all of these professionals to give you a beautiful smile and outstanding facial balance.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Goldstein Orthodontics, PC</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - University of Pennsylvania, Doctor of Dental Medicine</li><li>New York University, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>Northeastern Society of Orthodontists</li><li>American Dental Association</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.75, '2022-09-15'),
(6, 'Dr.  Evan Cohen , DMD', 'Orthodontist', '632d74cbbb68fd18b17a1e43d6fcb802Dr---Evan-Cohen---DMD.png', 'National Dental Sunnyside4321 Greenpoint Ave , Queens , NY  11104', 'Dr. Evan Cohen is an orthodontist serving the communities of East Meadow and Williston Park, NY. He attended Boston University, where he acquired his dental degree. A member of the American Association of Orthodontists and the American Dental Association, he is certified by the American Board of Orthodontics.    Dr. Cohen is currently with National Dental. He sees patients of all ages for a variety of dental services including dental cleanings, root canals, tooth extraction, snoring and sleep apnea, teeth whitening, and wisdom tooth problems. He also installs and removes braces, retainers, and Invisalign as well as conducting dental consultations and attending to dental emergencies.     Dr. Cohen&#x27;s investigations before diagnosis and treatment are thorough and systematic. He also explains patients’ conditions and describes the details of his intended treatment plan.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>National Dental</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Boston University, Doctor of Dental Medicine</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>American Dental Association</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Dental Consultation</li><li>Orthodontic Consultation</li><li>Pediatric Dentist Consultation</li><li>Root Canal</li><li>Tooth Extraction</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.50, '2022-09-15'),
(7, 'Dr.  Paul Carpinello , DMD', 'Orthodontist', 'de2291e634d53a26d25daa5b380ce0cbDr---Paul-Carpinello---DMD.png', '1041 Pontiac Rd , Drexel Hill , PA  19026', 'Hello and welcome to Carpinello Orthodontics, where we are changing the world one smile at a time! We believe that orthodontics is more than just straightening teeth. It enhances a person&#x27;s health and appearance, as well as self-esteem and confidence.    My team and I provide the highest quality of orthodontic treatment available for children and adults, applying advanced techniques using the most up-to-date appliances and braces. We take great pride in the courteous service we provide to every person who enters our office.    It is our goal to exceed the expectations of our patients and families. We are honored that you have placed your trust in our practice to provide you with beautiful, straight teeth.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Carpinello Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - University of Pennsylvania, Doctor of Dental Medicine</li><li>University of Pennsylvania (Residency)</li><li>Temple University, Certificate in Orthodontics</li><li>Temple University, Master’s in Clinical Dentistry</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>American Dental Association</li><li>Middle Atlantic Society of Orthodontists</li><li>Greater Philadelphia Society of Orthodontics</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.78, '2022-09-15'),
(8, 'Dr.  Paul Carpinello , DMD', 'Orthodontist', '224f0f00fce7f147a75f561122b4b0b7Dr---Paul-Carpinello---DMD.png', '3217 West Chester Pike, Unit C , Newtown Square , PA  19073', 'Hello and welcome to Carpinello Orthodontics, where we are changing the world one smile at a time! We believe that orthodontics is more than just straightening teeth. It enhances a person&#x27;s health and appearance, as well as self-esteem and confidence.    My team and I provide the highest quality of orthodontic treatment available for children and adults, applying advanced techniques using the most up-to-date appliances and braces. We take great pride in the courteous service we provide to every person who enters our office.    It is our goal to exceed the expectations of our patients and families. We are honored that you have placed your trust in our practice to provide you with beautiful, straight teeth.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Carpinello Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - University of Pennsylvania, Doctor of Dental Medicine</li><li>University of Pennsylvania (Residency)</li><li>Temple University, Certificate in Orthodontics</li><li>Temple University, Master’s in Clinical Dentistry</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>American Dental Association</li><li>Middle Atlantic Society of Orthodontists</li><li>Greater Philadelphia Society of Orthodontics</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></