(9, 'Dr.  Karen Lewkowitz , DDS', 'Orthodontist', '610bd8023694e5da21e181bdc4cd8bcfDr---Karen-Lewkowitz---DDS.png', '325 Broadway, Lobby Office , New York , NY  10007', 'Dr. Karen Lewkowitz is a leading Orthodontist. She is a Fellow in the American College of Dentists, member of the American Association of Orthodontists, the American Dental Association, and Past President of the Queens County Dental Society and Past Chairman of the National Children’s Dental Health Month for Queens County Dental Society. Dr. Lewkowitz is a graduate of Columbia University’s College of Dental Medicine and went on to complete a two year Orthodontic Specialty at NYU’s College of Dentistry at the top of her class.     Her services include palate expanders, habit breakers, full metal and clear braces, braces behind the teeth and Invisalign. Come meet Dr. Lewkowitz and see that her many years of experience, attention to detail and her warm chair side manner will delight you.    When asked why she went into orthodontics she replied, “I want to do for others what Orthodontics did for me! It gave me a beautiful smile that changed my life forever!”<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Paolo Saggese, DMD, PLLC</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>New York University, Certificate in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American College of Dentists</li><li>American Association of Orthodontists</li><li>American Dental Association</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Dental Consultation</li><li>Orthodontic Consultation</li><li>Tooth Extraction</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.50, '2022-09-15'),
(10, 'Dr.  Kathrin Praedikow , DDS', 'Orthodontist', 'b9a8c1023a2a9fb28adf3ae18c696a47Dr---Kathrin-Praedikow---DDS.png', '133 East 58th Street, 9th Floor, Suite 912 , New York , NY  10022', 'Complimentary Consultations Wednesdays &amp; Thursdays.     Kathrin Praedikow was born in Cologne Germany where she went to school and graduated from University of Cologne with a degree in Dentistry and a PhD in Dentistry. Dr. Praedikow worked in a multi-specialty dental office for three years before she and her husband moved to New York City where she earned another DDS degree and a postgraduate degree in Orthodontics and Maxillofacial Orthopedics at NYU College of Dentistry. During her postgraduate program, Dr. Praedikow was the co-director of the Orthodontic honor program for dental students where she taught dental students the basics of orthodontics and won the first price in the nationwide Invisalign University competition with one of the cases she was treating during her residency. Dr. Praedikow is a board certified Orthodontist and a member of the AAO, a diplomate of the Orthodontic board and a member of the ADA.  Dr. Praedikow is married and has three children, Carl, Leopold and Clara which are her biggest pride. When she is not working, she enjoys spending time with her kids, going for a run or long walks and skiing in winter.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Manhattan Family Orthodontics-Uptwn</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>New York University, Residency in Orthodontics and Maxillofacial Orthopedics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li><li>Temporo-Mandibular Joint (TMJ) Pain</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(11, 'Dr.  Jason Lin , DDS, MS', 'Orthodontist', '20644ce85b6869a75f083936fbce63f2Dr---Jason-Lin---DDS--MS.png', '11074 Queens Blvd , Forest Hills , NY  11375', 'Dr. Jason Lin grew up in the Tri-State area. He then moved back to the New York metropolitan area to obtain his Doctorate of Dental Surgery from Columbia University where he graduated at the top of his class with numerous honors and distinctions. He continued his education at Columbia University by completing an extensive three year residency in Orthodontics and Dentofacial Orthopedics where he served as Chief Resident during his final year.    Dr. Lin currently resides in Long Island City with his wife, Yena. In his free time, he loves spending time with family and friends, traveling the world, is an avid New York sports fan, and is a gym fanatic. He loves what he does for a living, devotes himself to loving others and the community around him, and takes great pride in developing beautiful smiles and the changes in self-esteem he encounters on a daily basis.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Austin Dental Plus</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>Columbia University, Master&#x27;s in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Dental Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(12, 'Dr.  Sabeeh Khan , DDS', 'Orthodontist', '7681f970e6bb5e7a06ecf43bd7d95825Dr---Sabeeh-Khan---DDS.png', '55-36 69th Place , Maspeth , NY  11378', 'Dr. Khan has been providing outstanding orthodontic care since 1992. He earned his doctorate as well as his post doctorate specialty certificate in orthodontics from Columbia University.    During his orthodontic training, Dr. Khan had the distinct honor of having Prof. M.L. Moss (the former dean of Columbia Dental School and a leading authority of cranial facial growth and development) as his reseach mentor. To stay up-to-date on the latest advancements in the field of orthodontics, Dr. Khan maintains active membership in numerous prestigious professional organizations such as the American Dental Association, the American Association of Orthodontics, the North East Society of Orthodontics, the New York State Dental Association and the Nassau County Dental Society. Dr. Khan has also been inducted into Sigma XI, The Scientific Research Society. Outside the office, Dr. Khan enjoys traveling, playing tennis, running, cycling, photography and spending time with his family. He and his wife, Azita, also an orthodontist, met while attending Columbia University. Married in 1989, they now have three sons.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Khan Orthodontic Group</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>Columbia University, Certificate in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.67, '2022-09-15'),
(13, 'Dr.  Adam Shatz , DDS', 'Orthodontist', 'e9ffbaf9b42265c3fa72801c4d1a9479Dr---Adam-Shatz---DDS.png', '37-43 77th St , Jackson Heights , NY  11372', 'Dr. Adam D. Shatz has been a specialist in the field of orthodontics with over seventeen years of experience. . He obtained his Doctorate of Dental Surgery and completed an Orthodontic Residency at the State University of New York at Stony Brook, School of Dental Medicine.    To keep up-to-date on the latest techniques and technology in orthodontics, Dr. Shatz holds memberships in many professional organizations, including the American Association of Orthodontists, the World Federation of Orthodontists, the Northeast Society of Orthodontists, the Nassau County Dental Society, the American Dental Association, and the Dental Society of the State of New York.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Jackson Heights Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - State University of New York, Stony Brook, Doctor of Dental Surgery</li><li>State University of New York, Stony Brook, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>Nassau County Dental Society</li><li>American Dental Association</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 3.33, '2022-09-15'),
(14, 'Dr.  Ronald Schwalb , DDS', 'Orthodontist', '8dfadfb5afae28960e208322398d2efeDr---Ronald-Schwalb---DDS.png', '30 East 40th Street, Suite 1102 , New York , NY  10016', 'We are excited that you have considered us and we look forward to speaking with you. Please note, our consultation fee is credited towards your orthodontic costs once you begin your treatment. In order to maximize your consultation, please advise us of any retainer repairs that you may be in need of in your notes, as we may need to appoint that at a time other than the one you have chosen!    As a Board-certified orthodontist, Dr. Ronald Schwalb will explain a range of orthodontic options and help you decide which one is right for you or your child. Dr. Schwalb has over 30 years of experience diagnosing and treating crowded and misaligned teeth and is committed to providing high-quality, affordable orthodontic care for everyone in your family. Our business staff has over 25 years experience in our office and excels in maximizing your insurance benefits and working with you and your financial needs.    We offer a variety of treatment options to best fit your orthodontic needs. Your consultation will determine which treatment is best for your case; metal or clear braces, Invisalign or appliance therapy such as Spring Aligners. Dr. Schwalb is one of the preferred Invisalign providers in New York City using state of the art Itero Scanning and has been providing Invisalign for approximately 15 years.    Should the need arise to change your appointment, we require 24 hours notice to best serve our patients. We welcome you to our practice and look forward to the opportunity to work together.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Ron Schwalb Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>New York University, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Teeth Whitening</li><li>Temporo-Mandibular Joint (TMJ) Pain</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.78, '2022-09-15'),
(15, 'Dr.  Michelle Katz , DDS', 'Orthodontist', '184550878e0c501c2c4f23e7ff22d12eDr---Michelle-Katz---DDS.png', '1196 Lexington Ave , New York , NY  10028', 'Dr. Michelle Katz graduated Magna Cum Laude from Cornell University and completed her Doctorate of Dental Surgery degree at New York University College of Dentistry. At NYU, Dr. Katz participated in two outreach programs to Nicaragua to provide dental healthcare to a community lacking the proper resources to receive dental care. Dr. Katz attended Montefiore Medical Center and completed a one-year general practice residency. Dr. Katz pursued her specialty training in Orthodontics at Jacksonville University. Dr. Katz ‘s affiliations include the American Association of Orthodontics and American Dental Association.     Dr. Katz resides in New York City with her husband Jeffrey, a practicing dentist she met while at NYU.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Dr. Michelle Katz Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>Jacksonville University, Certificate in Advanced Orthodontics</li><li>Montefiore Medical Center, Residency in General Practice</li><li>Cornell University (Bachelor&#x27;s)</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Bridge</li><li>Dental Cleaning</li><li>Dental Consultation</li><li>Orthodontic Consultation</li><li>Pediatric Dentist Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.30, '2022-09-15'),
(16, 'Dr.  Daniel Kuncio , DDS', 'Orthodontist', '368c89ad650306f256f10f19124fef04Dr---Daniel-Kuncio---DDS.png', '315 West 70th Street, Suite 1J , New York , NY  10023', 'Consultation copayment for each patient is 90$.  Dr. Kuncio is a dedicated clinician and former attending orthodontist/assistant professor at both Bronx Lebanon Hospital/Icahn School of Medicine at Mount Sinai, and Montefiore Medical Center/Albert Einstein College of Medicine. He is passionate about beautifying your smile and bettering your health—for now and well into the future.    Dr. Kuncio&#x27;s approach to orthodontics is guided by a simple yet crucial principle: nature comes first. Using this conservative approach, Dr. Kuncio doesn&#x27;t extract teeth or perform surgery—unless absolutely necessary. Like all orthodontists, he works to correct one&#x27;s natural teeth, and he will always take the least invasive means possible to get you to optimal health—and that dazzling smile.    Dr. Kuncio uses a wide variety of orthodontic techniques. From customized metal braces for speed, to Invisalign for convenience, to lingual (tongue-side) braces for discreteness, Dr. Kuncio is an expert in the technique that best suits you.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Kuncio Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - State University of New York, Buffalo, Doctor of Dental Surgery</li><li>Albert Einstein College of Medicine, Montefiore Medical Center, Residency in Orthodontics and Dentofacial Orthopedics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Dental Association</li><li>New York State Dental Association</li><li>New York County Dental Society</li><li>Northeastern Society of Orthodontists</li><li>American Association of Orthodontists</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.74, '2022-09-15'),
(17, 'Dr.  Olivier Nicolay , DDS', 'Orthodontist', '36dea2b5ef00e147c055583650bf4465Dr---Olivier-Nicolay---DDS.png', '133 East 58th Street, 9th Floor, Suite 912 , New York , NY  10022', '$95 Consultation Fee - Out of Network Provider    Olivier Nicolay, a native of France, was born in Lorraine and grew up near Paris where he earned his Docteur en Chirurgie Dentaire (DDS) from the Université René Descartes. After two years in private practice, he enrolled at the Harvard School of Dental Medicine in Boston for three years to study orthodontics and do research in that field.  At the end of his studies, he was awarded a Certificate in Orthodontics and a Masters in Medical Sciences.    Because of his experience in research, and to gain more knowledge and experience he decided to pursue an academic career,Dr. Nicolay taught postgraduate students and was involved in research at Ohio State University. In 1989, he assumed the position of Program Director at Columbia University while earning his DDS and while pursuing his interests in research and teaching orthodontics. He has been member of the NYU College of Dentistry since 2002.     Diplomate of the American Board of Orthodontics  Member of Angle East, component of the Angle Society of Orthodontists  American Association of Orthodontists  American Dental Association<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Manhattan Family Orthodontics-Uptwn</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Université Paris Descartes</li><li>Columbia University, Doctor of Dental Surgery</li><li>Harvard University, Certificate in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Dental Association</li><li>American Association of Orthodontists</li><li>Edward H. Angle Society of Orthodontists</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces Consultation</li><li>Dental Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Temporo-Mandibular Joint (TMJ) Pain</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(18, 'Dr.  Yoo Bin Lee , DDS', 'Orthodontist', 'd61715948a2d9706fb16f1580f73807bDr---Yoo-Bin-Lee---DDS.png', '220 Madison Avenue, Suite A , New York , NY  10016', 'Dr. Yoo Bin Lee grew up in many different cities all over the world – Seoul, Shanghai, Hong Kong, Houston and Chicago; and now calls NYC home.    Having studied human communication sciences at Northwestern University as an undergraduate, she discovered just how important the oral cavity was in the development of speech and communication, especially in the development of a child. With that in mind, she decided to pursue an education in dentistry, earning a Doctor of Dental Surgery (DDS) degree from NYU College of Dentistry. As a dental student, she was selected as an honor student in Orthodontics and participated in several research studies related to accelerated tooth movement.    After obtaining her DDS degree, Dr. Lee decided to pursue her passion for Orthodontics and went on to specialize in the field. She stayed on in New York and continued her post-doctoral orthodontic specialty training for an additional three years at NYU College of Dentistry.    Dr. Lee is board certified by the American Board of Orthodontics (ABO), the only orthodontic board certification that is recognized by the American Dental Association and American Association of Orthodontists. She is currently an active member of the American Association of Orthodontists, Northeastern Society of Orthodontists, American Dental Association and the International Association for Dental Research. When she’s not busy treating patients, Dr. Lee is also active in the field of research, having co-authored several articles related to accelerated tooth movement, one of which has been cited in over 100 other articles.    Outside of her practice, Dr. Lee is a firm believer in giving back to the community and using her skills and knowledge to help better the standards of oral health in the underserved community.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Simply Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>New York University (Orthodontics)</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>Northeastern Society of Orthodontists</li><li>International Association for Dental Research</li><li>American Dental Association</li><li>American Association of Orthodontists</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Install Braces</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15');
INSERT INTO `orthodontrys` (`id`, `dr_name`, `specialty`, `image`, `location`, `discription`, `review_rate`, `created_at`) VALUES
(19, 'Dr.  Jin Sup Shin , DDS, MS', 'Orthodontist', '34874519bcb908de3cf9dd57a8dcf6eaDr---Jin-Sup-Shin---DDS--MS.png', '30 Central Park S, #11D , New York , NY  10019', 'Dr. Shin is an &#x27;orthodontist&#x27;, a dental specialist with 3 additional years of highly selective training in &#x27;orthodontics and dentofacial orthopedics&#x27; from New York University. She teaches at NYU Orthodontics as an adjunct assistant professor and has her research published in scientific journals. She graduated top 2% with high honors and received multiple awards, including President&#x27;s Volunteer Service Award from President Obama in 2016 and induction into the distinguished National Dental Honors Society, Omicron Kappa Upsilon (OKU).     As a specialist, she not only creates beautiful, straight teeth but also is well-trained to comprehensively analyze inter-related problems in the jaw bones, muscles of the mouth and face,  and TM joints - along with growth pattern, breathing pattern, habits, tongue posture, and more - in order to correctly diagnose the root of the problem and to provide treatment options right for the individual patient.    Dr. Shin&#x27;s treatment philosophy is simple: to treat each patient as if her own family. She truly loves practicing orthodontics not only because it incorporates her talent in science and passion in art, but more so because she believes she can positively influence people&#x27;s lives with her caring yet smart orthodontic treatment to create a beautiful as well as healthy smile.      Outside the clinic, Dr. Shin loves to play tennis, explore the world, and spend time with her family.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>SmileWorks</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>New York University, Residency in Orthodontics and Dentofacial Orthopedics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Dental Association</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Dental Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.85, '2022-09-15'),
(20, 'Dr.  Paul Carpinello , DMD', 'Orthodontist', '32a465be0ddaaa08466a2a94e0c6f7f1Dr---Paul-Carpinello---DMD.png', '4877 West Chester Pike , Edgmont , PA  19028', 'Hello and welcome to Carpinello Orthodontics, where we are changing the world one smile at a time! We believe that orthodontics is more than just straightening teeth. It enhances a person&#x27;s health and appearance, as well as self-esteem and confidence.    My team and I provide the highest quality of orthodontic treatment available for children and adults, applying advanced techniques using the most up-to-date appliances and braces. We take great pride in the courteous service we provide to every person who enters our office.    It is our goal to exceed the expectations of our patients and families. We are honored that you have placed your trust in our practice to provide you with beautiful, straight teeth.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Carpinello Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - University of Pennsylvania, Doctor of Dental Medicine</li><li>University of Pennsylvania (Residency)</li><li>Temple University, Certificate in Orthodontics</li><li>Temple University, Master’s in Clinical Dentistry</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>American Dental Association</li><li>Middle Atlantic Society of Orthodontists</li><li>Greater Philadelphia Society of Orthodontics</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.78, '2022-09-15'),
(21, 'Dr.  Evan Cohen , DMD', 'Orthodontist', '4bd297eb850b1e5ea096d2b08b5e1c72Dr---Evan-Cohen---DMD.png', 'National Dental Williston Park215 Hillside Ave , Williston Park , NY  11596', 'Dr. Evan Cohen is an orthodontist serving the communities of East Meadow and Williston Park, NY. He attended Boston University, where he acquired his dental degree. A member of the American Association of Orthodontists and the American Dental Association, he is certified by the American Board of Orthodontics.    Dr. Cohen is currently with National Dental. He sees patients of all ages for a variety of dental services including dental cleanings, root canals, tooth extraction, snoring and sleep apnea, teeth whitening, and wisdom tooth problems. He also installs and removes braces, retainers, and Invisalign as well as conducting dental consultations and attending to dental emergencies.     Dr. Cohen&#x27;s investigations before diagnosis and treatment are thorough and systematic. He also explains patients’ conditions and describes the details of his intended treatment plan.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>National Dental</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Boston University, Doctor of Dental Medicine</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>American Dental Association</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Dental Consultation</li><li>Orthodontic Consultation</li><li>Pediatric Dentist Consultation</li><li>Root Canal</li><li>Tooth Extraction</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.50, '2022-09-15'),
(22, 'Dr.  Robert Lopatkin , DDS', 'Orthodontist', '3a072c81dab11bfa9da59f5170aa6a1cDr---Robert-Lopatkin---DDS.png', '29 Barstow Rd, 200 A , Great Neck , NY  11021', 'We are a full service owner owned orthodontic office with over 30 years of private practice and university affiliation. We specialize in high technology, minimal contact orthodontics for complex cases including pre-prosthetic and pre- corrective jaw surgery orthodontics. Consultations and second opinions are always complementary. Clear aligner and other esthetic options are paramount to successful treatment.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Advanced Digital Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - State University of New York, Stony Brook, Doctor of Dental Surgery</li><li>New York University (Orthodontics)</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Dental Association</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Headache</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.88, '2022-09-15'),
(23, 'Dr.  Evan Cohen , DMD', 'Orthodontist', '2435342e01bb5f87c7c7e665c8a48795Dr---Evan-Cohen---DMD.png', 'National Dental East Meadow2047 Hempstead Turnpike , East Meadow , NY  11554', 'Dr. Evan Cohen is an orthodontist serving the communities of East Meadow and Williston Park, NY. He attended Boston University, where he acquired his dental degree. A member of the American Association of Orthodontists and the American Dental Association, he is certified by the American Board of Orthodontics.    Dr. Cohen is currently with National Dental. He sees patients of all ages for a variety of dental services including dental cleanings, root canals, tooth extraction, snoring and sleep apnea, teeth whitening, and wisdom tooth problems. He also installs and removes braces, retainers, and Invisalign as well as conducting dental consultations and attending to dental emergencies.     Dr. Cohen&#x27;s investigations before diagnosis and treatment are thorough and systematic. He also explains patients’ conditions and describes the details of his intended treatment plan.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>National Dental</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Boston University, Doctor of Dental Medicine</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>American Dental Association</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Dental Consultation</li><li>Orthodontic Consultation</li><li>Pediatric Dentist Consultation</li><li>Root Canal</li><li>Tooth Extraction</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.50, '2022-09-15'),
(24, 'Dr.  Sabeeh Khan , DDS', 'Orthodontist', '4d41a1ed48086817b7989588b68cfe6eDr---Sabeeh-Khan---DDS.png', '28 Merrick Ave , Merrick , NY  11566', 'Dr. Khan has been providing outstanding orthodontic care since 1992. He earned his doctorate as well as his post doctorate specialty certificate in orthodontics from Columbia University.    During his orthodontic training, Dr. Khan had the distinct honor of having Prof. M.L. Moss (the former dean of Columbia Dental School and a leading authority of cranial facial growth and development) as his reseach mentor. To stay up-to-date on the latest advancements in the field of orthodontics, Dr. Khan maintains active membership in numerous prestigious professional organizations such as the American Dental Association, the American Association of Orthodontics, the North East Society of Orthodontics, the New York State Dental Association and the Nassau County Dental Society. Dr. Khan has also been inducted into Sigma XI, The Scientific Research Society. Outside the office, Dr. Khan enjoys traveling, playing tennis, running, cycling, photography and spending time with his family. He and his wife, Azita, also an orthodontist, met while attending Columbia University. Married in 1989, they now have three sons.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Khan Orthodontic Group</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>Columbia University, Certificate in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.67, '2022-09-15'),
(25, 'Dr.  Seth Newman , DDS', 'Orthodontist', 'de7d18d5bbfa044a686f2ca8d1fc449eDr---Seth-Newman---DDS.png', '14 Glen Cove Rd , Roslyn Heights , NY  11577', 'Dr. Seth Newman is passionate about creating an exceptional experience for our patients from the moment they walk through our door until they walk out with a radiant smile. He not only expects excellence from his team with rigorous standards for customer service and clinical excellence but also holds himself to the highest standards as an orthodontic provider. Dr. Newman is continually learning so that he and his team can implement the latest orthodontic innovations.    His passion for orthodontics has recently culminated in a book he co-authored with Dr. Giannoutsos called Giving it to you Straight. The book applies their passion for customer service and orthodontics and was intended to simplify orthodontics for patients.    Dr. Seth Newman is a board-certified orthodontic specialist for almost fifteen years. He is a graduate of Binghamton University and completed his dental training at Stony Brook School of Dental Medicine, where he graduated at the top of his class. He received multiple honors and awards, including the distinction of being inducted into Omicron Kappa Upsilon (OKU), the National Dental Honor Society. Dr. Newman furthered his education at Mount Sinai Medical Center in New York. He continued his post-graduate studies in Orthodontics at New York University College of Dentistry. While at NYU, Dr. Newman participated as a clinical instructor of the Invisalign appliance. He is also a past clinical-attending-doctor at Northwell (formerly LIJ).    Dr. Newman is also the owner and clinical director of Straight Set Orthodontics. With his exceptional team of staff and orthodontists, his philosophies on excellence and clinical service are spreading smiles throughout the Garden City area.    Dr. Newman and his wife, Stacey, reside in Roslyn, Long Island and are the proud parents of two sons, Alex and Charlie, and one princess, Kaylee. As a family, they enjoy boating, skiing and surrounding themselves with good friends and loving family.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Newman Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - State University of New York, Stony Brook, Doctor of Dental Surgery</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Temporo-Mandibular Joint (TMJ) Pain</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.52, '2022-09-15'),
(26, 'Dr.  Shawheen Saffari , DMD', 'Orthodontist', 'df880adf2db6d8b8184521f826cdee92Dr---Shawheen-Saffari---DMD.png', '1100 Pelham Pkwy S, Suite #1 , Bronx , NY  10461', '&quot;It was awesome the ladies at the front desk was great patient smiling friendly I would definetley recommend.&quot;<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>iSmile Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Tufts University, Doctor of Dental Medicine</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(27, 'Dr.  Corey Goldstein , DMD', 'Orthodontist', 'e0038fbaea5f418d27ec1b434d87f706Dr---Corey-Goldstein---DMD.png', '14 Maple St , Port Washington , NY  11050', 'Sometimes orthodontics cannot “fix” a problem alone. Nature, genetics and environmental factors sometimes result in situations that require help from other dental specialists. Bone relationships can affect the function and esthetics of the teeth and jaws. Sometimes oral surgeons are needed to perform orthognathic surgery to move bones. Periodontists may be needed to correct gum problems or place implants where teeth are missing. General dentists may need to replace missing or broken down teeth. We work with all of these professionals to give you a beautiful smile and outstanding facial balance.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Goldstein Orthodontics, PC</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - University of Pennsylvania, Doctor of Dental Medicine</li><li>New York University, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>Northeastern Society of Orthodontists</li><li>American Dental Association</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.75, '2022-09-15'),
(28, 'Dr.  Steven Schwartz , DDS', 'Orthodontist', 'e5b3b1291963ff8d175e0a6644b3c76dDr---Steven-Schwartz---DDS.png', '3341B Park Ave , Wantagh , NY  11793', '&quot;Really kind and accommodating. Provided accurate and useful information. Staff really pleasant. Was seen right away which was amazing!&quot;<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>North Fork Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - State University of New York, Stony Brook, Doctor of Dental Surgery</li><li>Harvard University, Certificate in Orthodontics</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.33, '2022-09-15'),
(29, 'Dr.  Joana Forsea , DDS', 'Orthodontist', 'f0a110ccccaafa4280139a7a7c267294Dr---Joana-Forsea---DDS.png', '3 School St, Suite 202 , Glen Cove , NY  11542', 'Dr. Forsea has been practicing orthodontics for over 20 years in New York and abroad in Europe. Ever since her graduation from NYU College of Dentistry and her Orthodontic Residency Program there, she has remained as a faculty member to oversee and train rising orthodontists for the next generation. She has perfected her expertise in treating children, adolescents, and adults with CLIII malocclusions (underbites) in addition to all dentofacial anomalies and malocclusions.    Dr. Forsea cares deeply about her patients overall well-being and health. She views orthodontics from the broad sense of treating the entire patient. This includes looking at the function of the occlusion, the bite, the aesthetics of the smile and the psychological implications of the treatment the patients are undergoing. She understands that treatment is not easy for patients and she strives to create an orthodontic experience that is custom fit for every patient.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Glen Cove Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>New York University, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 0.00, '2022-09-15'),
(30, 'Dr.  Sabeeh Khan , DDS', 'Orthodontist', '37ce5d8aa6d2e074c63fb6501abebc52Dr---Sabeeh-Khan---DDS.png', '500 North Broadway, suite 146 , Jericho , NY  11753', 'Dr. Khan has been providing outstanding orthodontic care since 1992. He earned his doctorate as well as his post doctorate specialty certificate in orthodontics from Columbia University.    During his orthodontic training, Dr. Khan had the distinct honor of having Prof. M.L. Moss (the former dean of Columbia Dental School and a leading authority of cranial facial growth and development) as his reseach mentor. To stay up-to-date on the latest advancements in the field of orthodontics, Dr. Khan maintains active membership in numerous prestigious professional organizations such as the American Dental Association, the American Association of Orthodontics, the North East Society of Orthodontics, the New York State Dental Association and the Nassau County Dental Society. Dr. Khan has also been inducted into Sigma XI, The Scientific Research Society. Outside the office, Dr. Khan enjoys traveling, playing tennis, running, cycling, photography and spending time with his family. He and his wife, Azita, also an orthodontist, met while attending Columbia University. Married in 1989, they now have three sons.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Khan Orthodontic Group</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>Columbia University, Certificate in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.67, '2022-09-15'),
(31, 'Dr.  Rose Katz , DDS', 'Orthodontist', '5a882c078403fdb610548b2b99499844Dr---Rose-Katz---DDS.png', '240 Madison Ave, 12th FL , New York , NY  10016', 'Free consultations available for new patients - schedule yours today!    A single smile can go a long way. Dr. Rose Katz feels lucky to be in the business of making beautiful smiles and looks forward to being her patients&#x27; partner in making a smile to last a lifetime! Experience in both the academic and clinical arenas have enabled her to see the real impact of orthodontics, and her role within it. The diversity of each day allows her to educate on the importance of oral health, improve the status quo and literally and figuratively transform patients’ smiles.    Dr. Katz continued to Stony Brook University to pursue a Doctor of Dental Surgery degree. After completing dental school, she received her orthodontic certificate from Montefiore Medical Center in the Bronx. Throughout her education, Dr. Katz interacted with leading minds and accomplished dentists to master the latest techniques and treatments for patients of all ages. Her orthodontic training focused on pediatric interceptive treatment, comprehensive treatment of adolescents and adults, Invisalign, as well as surgical orthodontics. With an active interest in the area, Dr. Katz frequents local and national conferences, seminars, and continuing education courses to stay up to date on the latest developments in the ever-evolving field.     Dr. Katz is excited to continue to practice state-of-the-art dental care with Dental365.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Dental365</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - State University of New York, Stony Brook, Doctor of Dental Surgery</li><li>Montefiore Medical Center, Certificate in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Dental Cleaning</li><li>Dental Consultation</li><li>Dental Emergency</li><li>New Patient Dental Exam (Adult)</li><li>Orthodontic Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(32, 'Dr.  Boris Arbitman , DDS', 'Orthodontist', 'a0cb08072ceafcb39ee65438146f7f8bDr---Boris-Arbitman---DDS.png', '104-60 Queens Blvd, Suite 1F , Forest Hills , NY  11375', 'Dr. Boris Arbitman has been providing high quality orthodontic care and creating beautiful smiles in Queens, NY and surrounding areas since 2005.    Having grown up in Forest Hills, Queens he attend college at the University of Michigan from 1993-1997 where he majored in Psychology. After graduating with high honors, he returned to the Northeast and received his dental training at the New York University College of Dentistry, from which he graduated in 2001 with honors. Upon completion of his D.D.S. degree, Dr. Arbitman furthered his training and experience in advanced dentistry and prosthetics at Long Island College Hospital and St. Barnabas Hospital where he served as Chief Resident. After completing his general practice residency training, he moved down South to Florida’s “First Coast” and completed his Advanced post graduate training in Orthodontics at the Jacksonville University - School of Orthodontics graduating with a Certificate of Advanced Graduate Studies in Orthodontics and Dentofacial Orthopedics. Dr. Arbitman was selected as the chief resident of his orthodontic class both years in Jacksonville. Upon Graduating from his Orthodontic program in 2005- Dr. Arbitman decided to leave the Sunshine State behind to return home to settle in New York.    Dr. Arbitman is an active member of the American Association of Orthodontists, American Dental Association and the Northeastern Society of Orthodontists. Additionally he is an active member of the board of the New York State Society of Orthodontists, and the Queens County Dental Society where he has served as the editor of their publication since 2007 as well as the chairman for the children’s dental health committee.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Boris Arbitman, DDS PC</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>Long Island College Hospital, Residency in General Practice</li><li>Jacksonville University, Certificate in Orthodontics and Dentofacial Orthopedics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.97, '2022-09-15'),
(33, 'Dr.  Jason Lin , DDS, MS', 'Orthodontist', 'b26bfdb0ec02a7c7c19f720a68159edbDr---Jason-Lin---DDS--MS.png', '80 River St, Penthouse , Hoboken , NJ  07030', 'Dr. Jason Lin is an orthodontist. He practices at Beam St., based in New both Hoboken, NJ, and New York, NY. During his consultations, he explains patients’ conditions and helps them choose a treatment plan that is appropriate for long-term goals.    Dr. Lin received his dental degree from Columbia University. He then obtained his master’s degree in orthodontics from the same institution. He is bilingual and speaks Mandarin as well as English. He helps patients receive the treatment they need.     Patients visit Dr. Lin for braces consultations and follow-ups, retainer installations, and retainer removal. He can also provide braces and retainer check-up appointments. He believes in listening to each patient and creating a partnership to maintain and improve lifelong health.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Beam St.</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>Columbia University, Master&#x27;s in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Cross Bite</li><li>Gapped Teeth</li><li>Install Invisalign</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.81, '2022-09-15'),
(34, 'Dr.  David Carpinello , DMD', 'Orthodontist', '35376b2ec16af5ef1cf80bee56f7da84Dr---David-Carpinello---DMD.png', '3217 West Chester Pike, Unit C , Newtown Square , PA  19073', 'How lucky are you? Going from one Dr. Carpinello to two! We are very proud to announce that Dr. David Carpinello has joined our team! Working alongside his father, he will continue the tradition of excellent orthodontic treatment to the people we are privileged to serve.    Dr. David Carpinello grew up here in Philadelphia. Prior to completing his DMD degree at Temple University Kornberg School of Dentistry where he was a member of Omicron Kappa Upsilon Honor Society.    He continued his training at Temple where he earned a certificate in the specialty of Orthodontics and Dental-Facial Orthopedics. He is a member of the American Association of Orthodontics, The Middle Atlantic Society of Orthodontics and the American Dental Association.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Carpinello Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Temple University, Doctor of Dental Medicine</li><li>Temple University, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>American Dental Association</li><li>Middle Atlantic Society of Orthodontists</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(35, 'Dr.  Michelle Katz , DDS', 'Orthodontist', 'cb78d4ebcd587089e23db0d39f24df79Dr---Michelle-Katz---DDS.png', '474 6th Avenue , New York , NY  10011', 'Dr. Michelle Katz graduated Magna Cum Laude from Cornell University and completed her Doctorate of Dental Surgery degree at New York University College of Dentistry. At NYU, Dr. Katz participated in two outreach programs to Nicaragua to provide dental healthcare to a community lacking the proper resources to receive dental care. Dr. Katz attended Montefiore Medical Center and completed a one-year general practice residency. Dr. Katz pursued her specialty training in Orthodontics at Jacksonville University. Dr. Katz ‘s affiliations include the American Association of Orthodontics and American Dental Association.     Dr. Katz resides in New York City with her husband Jeffrey, a practicing dentist she met while at NYU.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Dr. Michelle Katz Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>Jacksonville University, Certificate in Advanced Orthodontics</li><li>Montefiore Medical Center, Residency in General Practice</li><li>Cornell University (Bachelor&#x27;s)</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Bridge</li><li>Dental Cleaning</li><li>Dental Consultation</li><li>Orthodontic Consultation</li><li>Pediatric Dentist Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.30, '2022-09-15'),
(36, 'Dr.  Kristine M. Hyon , DMD, MS', 'Orthodontist', 'd3b658602711174f9ac3b08b4aa74ea0Dr---Kristine-M--Hyon---DMD--MS.png', '57 W 57th St, Suite 1414 , New York , NY  10019', 'Dr. Hyon graduated from University of Pennsylvania School of Dental Medicine.    She completed a year of general practice residency at the VA medical center in Philadelphia, PA.    She practiced general dentistry for 3 years in Philadelphia and in New Jersey before entering the orthodontic specialty residency at UMDNJ in 1997.    Dr. Hyon successfully completed the Orthodontic Residency Program and received an MS degree in Oral Biology in 2000. Her teaching experience as Associate Clinical Professor at UPenn as well as NYU dental school reflects her dedication to academic excellence and best quality care for her patients.    As a new office policy, there will be a consultation fee.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>KHL ORTHODONTICS LLC</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - University of Pennsylvania, Doctor of Dental Medicine</li><li>Philadelphia Veterans Affairs Medical Center, Residency in General Practice</li><li>University of Medicine and Dentistry of New Jersey, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Orthodontic Consultation</li><li>Pediatric Dentist Consultation</li><li>Temporo-Mandibular Joint (TMJ) Pain</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.67, '2022-09-15'),
(37, 'Dr.  Kathrin Praedikow , DDS', 'Orthodontist', '33614e4924f6f3e3cbb4f45cbfdee5d8Dr---Kathrin-Praedikow---DDS.png', '133 East 58th Street, 9th Floor, Suite 912 , New York , NY  10022', 'Complimentary Consultations Wednesdays &amp; Thursdays.     Kathrin Praedikow was born in Cologne Germany where she went to school and graduated from University of Cologne with a degree in Dentistry and a PhD in Dentistry. Dr. Praedikow worked in a multi-specialty dental office for three years before she and her husband moved to New York City where she earned another DDS degree and a postgraduate degree in Orthodontics and Maxillofacial Orthopedics at NYU College of Dentistry. During her postgraduate program, Dr. Praedikow was the co-director of the Orthodontic honor program for dental students where she taught dental students the basics of orthodontics and won the first price in the nationwide Invisalign University competition with one of the cases she was treating during her residency. Dr. Praedikow is a board certified Orthodontist and a member of the AAO, a diplomate of the Orthodontic board and a member of the ADA.  Dr. Praedikow is married and has three children, Carl, Leopold and Clara which are her biggest pride. When she is not working, she enjoys spending time with her kids, going for a run or long walks and skiing in winter.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Manhattan Family Orthodontics-Uptwn</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>New York University, Residency in Orthodontics and Maxillofacial Orthopedics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li><li>Temporo-Mandibular Joint (TMJ) Pain</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(38, 'Dr.  Elie Weiss , DDS', 'Orthodontist', '5824050ff78a6038bfc8ae584b2bdcfcDr---Elie-Weiss---DDS.png', '108-58 Queens Blvd , Forest Hills , NY  11375', '', 0.00, '2022-09-15'),
(39, 'Dr.  Jason Lin , DDS, MS', 'Orthodontist', '290a434c7f358bf242b0a556f522dcbcDr---Jason-Lin---DDS--MS.png', '11074 Queens Blvd , Forest Hills , NY  11375', 'Dr. Jason Lin grew up in the Tri-State area. He then moved back to the New York metropolitan area to obtain his Doctorate of Dental Surgery from Columbia University where he graduated at the top of his class with numerous honors and distinctions. He continued his education at Columbia University by completing an extensive three year residency in Orthodontics and Dentofacial Orthopedics where he served as Chief Resident during his final year.    Dr. Lin currently resides in Long Island City with his wife, Yena. In his free time, he loves spending time with family and friends, traveling the world, is an avid New York sports fan, and is a gym fanatic. He loves what he does for a living, devotes himself to loving others and the community around him, and takes great pride in developing beautiful smiles and the changes in self-esteem he encounters on a daily basis.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Austin Dental Plus</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>Columbia University, Master&#x27;s in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Dental Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15');
INSERT INTO `orthodontrys` (`id`, `dr_name`, `specialty`, `image`, `location`, `discription`, `review_rate`, `created_at`) VALUES
(40, 'Dr.  Sabeeh Khan , DDS', 'Orthodontist', '1f45253f1f72b75ce36c447dafb72b1fDr---Sabeeh-Khan---DDS.png', '55-36 69th Place , Maspeth , NY  11378', 'Dr. Khan has been providing outstanding orthodontic care since 1992. He earned his doctorate as well as his post doctorate specialty certificate in orthodontics from Columbia University.    During his orthodontic training, Dr. Khan had the distinct honor of having Prof. M.L. Moss (the former dean of Columbia Dental School and a leading authority of cranial facial growth and development) as his reseach mentor. To stay up-to-date on the latest advancements in the field of orthodontics, Dr. Khan maintains active membership in numerous prestigious professional organizations such as the American Dental Association, the American Association of Orthodontics, the North East Society of Orthodontics, the New York State Dental Association and the Nassau County Dental Society. Dr. Khan has also been inducted into Sigma XI, The Scientific Research Society. Outside the office, Dr. Khan enjoys traveling, playing tennis, running, cycling, photography and spending time with his family. He and his wife, Azita, also an orthodontist, met while attending Columbia University. Married in 1989, they now have three sons.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Khan Orthodontic Group</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>Columbia University, Certificate in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.67, '2022-09-15'),
(41, 'Dr.  Adam Shatz , DDS', 'Orthodontist', 'e12b95bf7b219682ddaf1c98e987db73Dr---Adam-Shatz---DDS.png', '37-43 77th St , Jackson Heights , NY  11372', 'Dr. Adam D. Shatz has been a specialist in the field of orthodontics with over seventeen years of experience. . He obtained his Doctorate of Dental Surgery and completed an Orthodontic Residency at the State University of New York at Stony Brook, School of Dental Medicine.    To keep up-to-date on the latest techniques and technology in orthodontics, Dr. Shatz holds memberships in many professional organizations, including the American Association of Orthodontists, the World Federation of Orthodontists, the Northeast Society of Orthodontists, the Nassau County Dental Society, the American Dental Association, and the Dental Society of the State of New York.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Jackson Heights Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - State University of New York, Stony Brook, Doctor of Dental Surgery</li><li>State University of New York, Stony Brook, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>Nassau County Dental Society</li><li>American Dental Association</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 3.33, '2022-09-15'),
(42, 'Dr.  Pooja Rana , DMD', 'Orthodontist', '379d6db35eb6df1da02e54db54dce654Dr---Pooja-Rana---DMD.png', '110 E 40th St, Suite 104 , New York , NY  10016', 'Dr. Pooja Rana is a Board-Certified Orthodontist who believes everyone should be able to smile with confidence. She received her Doctor of Dental Medicine degree from New Jersey Dental School and then went on to complete a year of advanced post-doctoral training in general dentistry at the Manhattan VA hospital. From there, Dr. Rana completed an additional three years of specialized training in Orthodontics at Montefiore Medical Center where she learned the most advanced techniques for treating both children and adults. Dr. Rana offers highly esthetic options like Invisalign clear aligners and ceramic braces as well as traditional braces. With passion and warmth, coupled with the skill and dexterity required of her profession, she would be honored to work with you and to support you in your orthodontic needs.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Expert Dental, P.C.</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Rutgers, The State University of New Jersey, Doctor of Dental Medicine</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Dental Consultation</li><li>Orthodontic Consultation</li><li>Pediatric Dentist Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 0.00, '2022-09-15'),
(43, 'Dr.  Kerisa Harriott , DMD', 'Orthodontist', '2d218968c4ec5df6f67ae5b8b7b126faDr---Kerisa-Harriott---DMD.png', '110 E 40th St, Suite 104 , New York , NY  10016', 'Dr. Kerisa Harriott is a Board-certified Orthodontist born and raised in Kingston, Jamaica. She attended Randolph-Macon College in Virginia. She went on to attend Rutgers School of Dental Medicine where she obtained her Doctor of Dental Medicine (DMD) degree also on scholarship. After dental school, Dr. Harriott completed a general practice residency (GPR) at Northwell Health Hospital (formerly Long Island Jewish Medical Center) where she was awarded Resident of the year. She practiced briefly as a General Dentist before starting an orthodontic residency at Stony Brook University. Her training at Stony Brook University included a wide array of orthodontic techniques i.e. Invisalign, ceramic braces, traditional braces, TADs, propel for accelerated treatment, among other techniques. In recognition of her hardwork and talent, she was given the Turner Fellowship award. Dr. Harriott loves Orthodontics and takes a patient-centered, gentle and compassionate approach while keeping abreast with the latest advances in the field. She considers it a privilege to be able to change lives one smile at a time.    Dr. Harriott participates in several outreach initiatives both locally and overseas such as dental missions, scholarship fundraisers, health fairs, charity fashion shows, among other efforts. Dr. Harriott is an avid dancer, philanthropist and lover of life. On her off days, she enjoys spending time with her husband cooking and exploring the city.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Expert Dental, P.C.</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Rutgers, The State University of New Jersey, Doctor of Dental Medicine</li><li>Northwell Health Hospital, Residency in General Practice</li><li>State University of New York, Stony Brook, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Dental Consultation</li><li>Orthodontic Consultation</li><li>Pediatric Dentist Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.00, '2022-09-15'),
(44, 'Dr.  Ronald Schwalb , DDS', 'Orthodontist', 'd1706cdb4a239b32124b7e7bc2339f85Dr---Ronald-Schwalb---DDS.png', '30 East 40th Street, Suite 1102 , New York , NY  10016', 'We are excited that you have considered us and we look forward to speaking with you. Please note, our consultation fee is credited towards your orthodontic costs once you begin your treatment. In order to maximize your consultation, please advise us of any retainer repairs that you may be in need of in your notes, as we may need to appoint that at a time other than the one you have chosen!    As a Board-certified orthodontist, Dr. Ronald Schwalb will explain a range of orthodontic options and help you decide which one is right for you or your child. Dr. Schwalb has over 30 years of experience diagnosing and treating crowded and misaligned teeth and is committed to providing high-quality, affordable orthodontic care for everyone in your family. Our business staff has over 25 years experience in our office and excels in maximizing your insurance benefits and working with you and your financial needs.    We offer a variety of treatment options to best fit your orthodontic needs. Your consultation will determine which treatment is best for your case; metal or clear braces, Invisalign or appliance therapy such as Spring Aligners. Dr. Schwalb is one of the preferred Invisalign providers in New York City using state of the art Itero Scanning and has been providing Invisalign for approximately 15 years.    Should the need arise to change your appointment, we require 24 hours notice to best serve our patients. We welcome you to our practice and look forward to the opportunity to work together.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Ron Schwalb Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>New York University, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Teeth Whitening</li><li>Temporo-Mandibular Joint (TMJ) Pain</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.78, '2022-09-15'),
(45, 'Dr.  Michelle Katz , DDS', 'Orthodontist', 'd9fe3cf18eaed427897ff6bbe3db3056Dr---Michelle-Katz---DDS.png', '1196 Lexington Ave , New York , NY  10028', 'Dr. Michelle Katz graduated Magna Cum Laude from Cornell University and completed her Doctorate of Dental Surgery degree at New York University College of Dentistry. At NYU, Dr. Katz participated in two outreach programs to Nicaragua to provide dental healthcare to a community lacking the proper resources to receive dental care. Dr. Katz attended Montefiore Medical Center and completed a one-year general practice residency. Dr. Katz pursued her specialty training in Orthodontics at Jacksonville University. Dr. Katz ‘s affiliations include the American Association of Orthodontics and American Dental Association.     Dr. Katz resides in New York City with her husband Jeffrey, a practicing dentist she met while at NYU.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Dr. Michelle Katz Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>Jacksonville University, Certificate in Advanced Orthodontics</li><li>Montefiore Medical Center, Residency in General Practice</li><li>Cornell University (Bachelor&#x27;s)</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Bridge</li><li>Dental Cleaning</li><li>Dental Consultation</li><li>Orthodontic Consultation</li><li>Pediatric Dentist Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.30, '2022-09-15'),
(46, 'Dr.  Daniel Kuncio , DDS', 'Orthodontist', 'fd75e3e168e976a9fb185a2ea38d91c8Dr---Daniel-Kuncio---DDS.png', '315 West 70th Street, Suite 1J , New York , NY  10023', 'Consultation copayment for each patient is 90$.  Dr. Kuncio is a dedicated clinician and former attending orthodontist/assistant professor at both Bronx Lebanon Hospital/Icahn School of Medicine at Mount Sinai, and Montefiore Medical Center/Albert Einstein College of Medicine. He is passionate about beautifying your smile and bettering your health—for now and well into the future.    Dr. Kuncio&#x27;s approach to orthodontics is guided by a simple yet crucial principle: nature comes first. Using this conservative approach, Dr. Kuncio doesn&#x27;t extract teeth or perform surgery—unless absolutely necessary. Like all orthodontists, he works to correct one&#x27;s natural teeth, and he will always take the least invasive means possible to get you to optimal health—and that dazzling smile.    Dr. Kuncio uses a wide variety of orthodontic techniques. From customized metal braces for speed, to Invisalign for convenience, to lingual (tongue-side) braces for discreteness, Dr. Kuncio is an expert in the technique that best suits you.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Kuncio Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - State University of New York, Buffalo, Doctor of Dental Surgery</li><li>Albert Einstein College of Medicine, Montefiore Medical Center, Residency in Orthodontics and Dentofacial Orthopedics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Dental Association</li><li>New York State Dental Association</li><li>New York County Dental Society</li><li>Northeastern Society of Orthodontists</li><li>American Association of Orthodontists</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.74, '2022-09-15'),
(47, 'Dr.  Ryan Trulby , DDS', 'Orthodontist', '319b042d5cf8d69d6eac0f0ec3fbfefeDr---Ryan-Trulby---DDS.png', '343 Central Ave , Jersey City , NJ  07307', 'Dr. Trulby completed his dental and orthodontics training at Columbia University just across the river, where he was chief resident and received awards for graduating at the top of his class.  Ryan continues to be involved at Columbia as an associate orthodontics faculty and secretary of the Columbia Orthodontics Alumni Society.    He’s completed several advanced training courses in Invisalign and a variety of additional topics, always aiming to learn something new every day.  Dr. Trulby has a lovely partner, Gabriella; is a devoted dog parent to his boxer, Niko.    When he’s not transforming smiles, he spends his downtime running the occasional marathon or reading a new book.  He also is (almost) fluent in Spanish and is a die-hard FC Barcelona fan—Visca Barça!<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Heights Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>Columbia University, Master&#x27;s in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.84, '2022-09-15'),
(48, 'Dr.  Tanya Vaysman , DMD', 'Orthodontist', 'd5b863518a7f937741ab11ac76cfbdb8Dr---Tanya-Vaysman---DMD.png', 'Upper Eastside Orthodontists153 East 87 Street, Suite 1B , New York , NY  10128', 'Dr. Vaysman is an accomplished, respected and highly qualified orthodontist utilizing the very latest techniques in orthodontic treatment. Her practice prides itself in excellence in technical acumen, patient rapport, specializing in &#x27;invisible&#x27; treatment for all ages of adults and the very best quality care pediatric orthodontics.    Dr. Vaysman received her bachelor degree in Biology from Fairleigh Dickinson University, where she graduated Magna Cum Laude, followed by The University of Medicine and Dentistry of New Jersey. During her studies in dental school Dr. Vaysman has been a recipient of multiple honors and awards such as the Academy of Dental Materials Award and the American Association of Women Dentists Colgate-Palmolive Research Award. (Where she was one of just ten nationwide recipients.) She graduated dental school in the top 5% and was enrolled into Omicron Kappa Upsilon National Dental Honor Society.    Dr. Vaysman attended a two year postgraduate program at NYU Dental school to receive her orthodontic specialty certification. She has also recently been appointed to the Orthodontic faculty in the Department of Dentistry and Maxillofacial Surgery at the Mount Sinai School of Medicine in New York City.    Dr. Vaysman resides on the Upper East Side with her husband and their two young children.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Dental365</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - University of Medicine and Dentistry of New Jersey, Doctor of Dental Medicine</li><li>New York University, Certificate in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>American Dental Association</li><li>New York State Dental Association</li><li>New York County Dental Society</li><li>The New York Academy of Collaborative Dentistry</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.78, '2022-09-15'),
(49, 'Dr.  Reena Clarkson , DDS', 'Orthodontist', '397ca26b4f3f5b3fc875ab057e439867Dr---Reena-Clarkson---DDS.png', '401 6th Ave.401 6th Avenue, 2nd Floor , New York , NY  10014', 'Reena Clarkson DDS is a dedicated and experienced orthodontist who provides exceptional dental care as part of the team at Village Dental Medicine.   Dr Clarkson earned her dental degree from prestigious college of dentistry at New York University and completed her orthodontic residency at Vanderbilt University in Nashville, Tennessee.  Dr Clarkson is passionate about giving people the smiles that they deserve.   She&#x27;s happily married to a fellow doctor and has six wonderful children.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Village Dental Medicine</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>Vanderbilt University, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Dental Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(50, 'Dr.  Jason Lin , DDS, MS', 'Orthodontist', '65ed5956e2611f12167c692fb11a9f17Dr---Jason-Lin---DDS--MS.png', '3 West 13th Street, Floor 1 , New York , NY  10011', 'Dr. Jason Lin is an orthodontist. He practices at Beam St., based in New both Hoboken, NJ, and New York, NY. During his consultations, he explains patients’ conditions and helps them choose a treatment plan that is appropriate for long-term goals.    Dr. Lin received his dental degree from Columbia University. He then obtained his master’s degree in orthodontics from the same institution. He is bilingual and speaks Mandarin as well as English. He helps patients receive the treatment they need.     Patients visit Dr. Lin for braces consultations and follow-ups, retainer installations, and retainer removal. He can also provide braces and retainer check-up appointments. He believes in listening to each patient and creating a partnership to maintain and improve lifelong health.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Beam St.</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>Columbia University, Master&#x27;s in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Cross Bite</li><li>Gapped Teeth</li><li>Install Invisalign</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.81, '2022-09-15'),
(51, 'Dr.  Olivier Nicolay , DDS', 'Orthodontist', '140b8bec64265ca9171c6c7107c88de7Dr---Olivier-Nicolay---DDS.png', '133 East 58th Street, 9th Floor, Suite 912 , New York , NY  10022', '$95 Consultation Fee - Out of Network Provider    Olivier Nicolay, a native of France, was born in Lorraine and grew up near Paris where he earned his Docteur en Chirurgie Dentaire (DDS) from the Université René Descartes. After two years in private practice, he enrolled at the Harvard School of Dental Medicine in Boston for three years to study orthodontics and do research in that field.  At the end of his studies, he was awarded a Certificate in Orthodontics and a Masters in Medical Sciences.    Because of his experience in research, and to gain more knowledge and experience he decided to pursue an academic career,Dr. Nicolay taught postgraduate students and was involved in research at Ohio State University. In 1989, he assumed the position of Program Director at Columbia University while earning his DDS and while pursuing his interests in research and teaching orthodontics. He has been member of the NYU College of Dentistry since 2002.     Diplomate of the American Board of Orthodontics  Member of Angle East, component of the Angle Society of Orthodontists  American Association of Orthodontists  American Dental Association<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Manhattan Family Orthodontics-Uptwn</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Université Paris Descartes</li><li>Columbia University, Doctor of Dental Surgery</li><li>Harvard University, Certificate in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Dental Association</li><li>American Association of Orthodontists</li><li>Edward H. Angle Society of Orthodontists</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces Consultation</li><li>Dental Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Temporo-Mandibular Joint (TMJ) Pain</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(52, 'Dr.  Whitney Mostafiz , DMD', 'Orthodontist', 'fa19c2017f26f7b6b41bd5737643ca03Dr---Whitney-Mostafiz---DMD.png', '121 E 60th St, Suite 1C , New York , NY  10022', 'Attn: Consultation fees are not refundable and will be applied towards treatment fees. Dr. Whitney is an out-of-network provider &amp; accepts PPO insurances that have orthodontic benefits (please check before booking to see if you have coverage).     Dr. Whitney Mostafiz-Levinson is a Board-Certified orthodontist &amp; looks forward to offering you a warm, memorable experience with a focus on one-on-one personalized care.    Dr. Whitney has dreamed of becoming an orthodontist since she was 12 and is excited to share her passion with you. A NY native, Dr. Whitney studied human biology and visual art at Brown University and completed dental school at Harvard. Dr. Whitney serves as an Adjunct Professor at NYU&#x27;s Dept. of Orthodontics. Dr. Whitney completed her orthodontics residency at the historic University of Illinois at Chicago, where her research led to a Masters degree. Dr. Whitney has published award-winning research on obstructive sleep apnea  appliance therapy. She treats both children and adults with traditional braces and Invisalign therapy. She utilizes 3D digital diagnostics including the iTero element scanner &amp; Propel/Orthopulse acceleration techniques. In addition, Dr. Whitney has experience with early interventional treatment and combined surgical treatment.     An active leader in the dental and orthodontic community, Dr. Whitney participated in the 2015 American Association of Orthodontists Emerging Leaders Conference. She is on the 2017-2022 NYC Give Kids a Smile Steering Committees. She is president of the New York Chapter of Alpha Omega International Dental Society. She lectures both locally and afar. Outside of the office, Dr. Whitney loves to keep active, and even finished the Chicago Marathon. She enjoys drawing, painting, photography, and graphic design.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Dr. Whitney Mostafiz</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Harvard University, Doctor of Dental Medicine</li><li>University of Illinois, Chicago, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Dental Association</li><li>New York County Dental Society</li><li>College of Diplomates of the American Board of Orthodontics</li><li>American Association of Orthodontists</li><li>Alpha Omega International Dental Fraternity</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces Consultation</li><li>Gapped Teeth</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Teeth Whitening</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.93, '2022-09-15'),
(53, 'Dr.  Jae Kim , DDS', 'Orthodontist', '2f6c59e5ebe8450660cd9a024435a7e7Dr---Jae-Kim---DDS.png', 'National Dental Oakland Gardens61-54 Springfield Blvd , Oakland Gardens , NY  11364', 'Dr. Jae Kim is an orthodontist at National Dental. He sees patients in New York and The Bronx, NY.    Dr. Kim attended New York University, where he acquired his dental degree. He then received his master&#x27;s degree in orthodontics from the University of Southern California. He is board-certified by the American Board of Orthodontics and a member of the American Association of Orthodontists and Omicron Kappa Upsilon.     As a part of his services, Dr. Kim installs and checks braces, retainers, and Invisaligns. He also offers teeth whitening, treatment for sleep apnea, root canals, gum surgery and pediatric dentist consultations. He takes every possible measure to ensure stress-free visits at his clinic.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>National Dental</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>University of Southern California, Master&#x27;s in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>Omicron Kappa Upsilon</li><li>American Association of Orthodontists</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Dental Consultation</li><li>Orthodontic Consultation</li><li>Pediatric Dentist Consultation</li><li>Root Canal</li><li>Tooth Extraction</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(54, 'Dr.  Yoo Bin Lee , DDS', 'Orthodontist', '6a91687960eb84f6f789b2e597d9e37fDr---Yoo-Bin-Lee---DDS.png', '220 Madison Avenue, Suite A , New York , NY  10016', 'Dr. Yoo Bin Lee grew up in many different cities all over the world – Seoul, Shanghai, Hong Kong, Houston and Chicago; and now calls NYC home.    Having studied human communication sciences at Northwestern University as an undergraduate, she discovered just how important the oral cavity was in the development of speech and communication, especially in the development of a child. With that in mind, she decided to pursue an education in dentistry, earning a Doctor of Dental Surgery (DDS) degree from NYU College of Dentistry. As a dental student, she was selected as an honor student in Orthodontics and participated in several research studies related to accelerated tooth movement.    After obtaining her DDS degree, Dr. Lee decided to pursue her passion for Orthodontics and went on to specialize in the field. She stayed on in New York and continued her post-doctoral orthodontic specialty training for an additional three years at NYU College of Dentistry.    Dr. Lee is board certified by the American Board of Orthodontics (ABO), the only orthodontic board certification that is recognized by the American Dental Association and American Association of Orthodontists. She is currently an active member of the American Association of Orthodontists, Northeastern Society of Orthodontists, American Dental Association and the International Association for Dental Research. When she’s not busy treating patients, Dr. Lee is also active in the field of research, having co-authored several articles related to accelerated tooth movement, one of which has been cited in over 100 other articles.    Outside of her practice, Dr. Lee is a firm believer in giving back to the community and using her skills and knowledge to help better the standards of oral health in the underserved community.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Simply Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>New York University (Orthodontics)</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>Northeastern Society of Orthodontists</li><li>International Association for Dental Research</li><li>American Dental Association</li><li>American Association of Orthodontists</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Install Braces</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(55, 'Dr.  Christina Seong , DMD', 'Orthodontist', '7465053f6b88b3252f8ff1dbb764ff65Dr---Christina-Seong---DMD.png', '53 E 122nd Street , New York , NY  10035', '', 0.00, '2022-09-15'),
(56, 'Dr.  Kris Togias , DMD', 'Orthodontist', '8584162e459072c167fedf9595b8d26bDr---Kris-Togias---DMD.png', '133 East 58th Street, 9th Floor, Suite 912 , New York , NY  10022', '$95 Consultation Fee - This is an IN NETWORK Provider    Born in Rochester, New York, Dr. Kris Togias completed his early education in Greece. Upon returning to the United States, Dr. Togias completed his undergraduate degree in Biology and Chemistry from the University of Rochester, after which he moved to Boston. He earned his dental degree from Tufts University School of Dental Medicine and went on to complete a postgraduate specialty residency in Orthodontics and Maxillofacial Orthopedics.    As a dentist with additional and specialized treatment in Orthodontics, Dr. Togias recognizes various characteristics of a malocclusion or dentofacial deformity, define the nature of the problem, including the etiology if possible, and design a treatment strategy based on the specific needs and desires of the patient. He is committed to comprehensive, high-quality orthodontic care with a focus on individualized treatment based on the unique needs of patients of all ages. While treating early orthodontic and adolescent cases, Dr. Togias also specializes in managing cases in children with growth and development concerns and syndromes such as cleft lip and palate, congenitally missing teeth, impacted and supernumerary teeth, and combination orthodontic/orthognathic surgery adult treatments.    Dr. Togias offers multiple corrective appliances from clear aligner therapies such as Invisalign®, clear and metal braces, as well as Incognito® lingual braces.    He is an active member of several professional dental organizations, including the American Orthodontic Association (AOA) and the American Dental Association (ADA).<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Manhattan Family Orthodontics-Uptwn</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Tufts University, Doctor of Dental Medicine</li><li>Tufts University, Residency in Orthodontics and Maxillofacial Orthopedics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Dental Association</li><li>American Association of Orthodontists</li><li>New York County Dental Society</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Oral Surgery Consultation</li><li>Orthodontic Consultation</li><li>Temporo-Mandibular Joint (TMJ) Pain</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.85, '2022-09-15'),
(57, 'Dr.  Olga Bukholts , DDS', 'Orthodontist', '14f2bcb4407d09f05fe0aeb1234417b8Dr---Olga-Bukholts---DDS.png', '263 West End Avenue, Suite 1A , New York , NY  10023', 'Dr. Olga Bukholts provides the highest quality orthodontic treatment for adults, teens, pre-teens and children.     Dr. Bukholts graduated from the prestigious Honors Combined Accelerated BA/DDS Degree program at New York University College of Arts and Sciences and New York University College of Dentistry, one of only 5 students accepted annually. She completed her general practice residency program at Staten Island University Hospital Center. Following her residency, she practiced as a general dentist in Manhattan.    Dr. Bukholts completed her orthodontics training at New York University College of Dentistry&#x27;s orthodontic program. She is an Assistant Clinical Professor in the Department of Orthodontics at New York University College of Dentistry.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Perfect Smiles Orthodontics, PC</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>Staten Island University Hospital, Residency in General Dentistry</li><li>New York University, Certificate in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Orthodontic Consultation</li><li>Teeth Whitening</li><li>Temporo-Mandibular Joint (TMJ) Pain</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.55, '2022-09-15'),
(58, 'Dr.  Jin Sup Shin , DDS, MS', 'Orthodontist', '5e7da28827db6eba061435a077e44d4fDr---Jin-Sup-Shin---DDS--MS.png', '30 Central Park S, #11D , New York , NY  10019', 'Dr. Shin is an &#x27;orthodontist&#x27;, a dental specialist with 3 additional years of highly selective training in &#x27;orthodontics and dentofacial orthopedics&#x27; from New York University. She teaches at NYU Orthodontics as an adjunct assistant professor and has her research published in scientific journals. She graduated top 2% with high honors and received multiple awards, including President&#x27;s Volunteer Service Award from President Obama in 2016 and induction into the distinguished National Dental Honors Society, Omicron Kappa Upsilon (OKU).     As a specialist, she not only creates beautiful, straight teeth but also is well-trained to comprehensively analyze inter-related problems in the jaw bones, muscles of the mouth and face,  and TM joints - along with growth pattern, breathing pattern, habits, tongue posture, and more - in order to correctly diagnose the root of the problem and to provide treatment options right for the individual patient.    Dr. Shin&#x27;s treatment philosophy is simple: to treat each patient as if her own family. She truly loves practicing orthodontics not only because it incorporates her talent in science and passion in art, but more so because she believes she can positively influence people&#x27;s lives with her caring yet smart orthodontic treatment to create a beautiful as well as healthy smile.      Outside the clinic, Dr. Shin loves to play tennis, explore the world, and spend time with her family.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>SmileWorks</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>New York University, Residency in Orthodontics and Dentofacial Orthopedics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Dental Association</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Dental Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.85, '2022-09-15');
INSERT INTO `orthodontrys` (`id`, `dr_name`, `specialty`, `image`, `location`, `discription`, `review_rate`, `created_at`) VALUES
(59, 'Dr.  Jason Lin , DDS', 'Orthodontist', '6792cc4a964f6afd47b7a9e05492e08bDr---Jason-Lin---DDS.png', '110 E 40th St, Suite 104 , New York , NY  10016', 'Dr. Jason Lin grew up in the Tri-State area but went to the Midwest to attend college at Washington University in St. Louis where he graduated with honors with a double major in Biochemistry and Economics. He then moved back to the New York metropolitan area to obtain his Doctorate of Dental Surgery from Columbia University where he graduated at the top of his class with numerous honors and distinctions. He continued his education at Columbia University by completing an extensive three year residency in Orthodontics and Dentofacial Orthopedics where he served as Chief Resident during his final year. In his free time, he loves spending time with family and friends, traveling the world, is an avid New York sports fan, and is a gym fanatic. He loves doing orthodontics and devotes himself to loving others and the community around him, and takes great pride in developing beautiful smiles and the changes in self-esteem he encounters on a daily basis.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Expert Dental, P.C.</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>Columbia University, Master&#x27;s in Orthodontics and Dentofacial Orthopedics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Dental Consultation</li><li>Orthodontic Consultation</li><li>Pediatric Dentist Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(60, 'Dr.  Paul Carpinello , DMD', 'Orthodontist', '6f2725f37647244c99b1c8101837ae3eDr---Paul-Carpinello---DMD.png', '4877 West Chester Pike , Edgmont , PA  19028', 'Hello and welcome to Carpinello Orthodontics, where we are changing the world one smile at a time! We believe that orthodontics is more than just straightening teeth. It enhances a person&#x27;s health and appearance, as well as self-esteem and confidence.    My team and I provide the highest quality of orthodontic treatment available for children and adults, applying advanced techniques using the most up-to-date appliances and braces. We take great pride in the courteous service we provide to every person who enters our office.    It is our goal to exceed the expectations of our patients and families. We are honored that you have placed your trust in our practice to provide you with beautiful, straight teeth.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Carpinello Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - University of Pennsylvania, Doctor of Dental Medicine</li><li>University of Pennsylvania (Residency)</li><li>Temple University, Certificate in Orthodontics</li><li>Temple University, Master’s in Clinical Dentistry</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>American Dental Association</li><li>Middle Atlantic Society of Orthodontists</li><li>Greater Philadelphia Society of Orthodontics</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.78, '2022-09-15'),
(61, 'Dr.  Ashi Adamjee , DDS', 'Orthodontist', 'adbc7fd6646675268b2b0a280c69f300Dr---Ashi-Adamjee---DDS.png', '207 E 94th St, 5th Floor , New York , NY  10128', 'Dr. Adamjee earned her Doctorate in Dental Surgery from Columbia University College of Dental Medicine. During this time she was the recipient of numerous honors and awards including the American Association of Orthodontists Award for Exceptional Interest in the Development of the Oro-Facial Complex,  the Award of Divisional Excellence in Orthodontics and the Eugene Rothschild Memorial Award from the New York Academy of Oral Rehabilitation. Dr. Adamjee was also inducted into Omicron Kappa Upsilon-the National Dental Honor Society.    Following dental school, Dr. Adamjee completed a three year orthodontic residency program from Montefiore Medical Center in association with Albert Einstein School of Medicine where she learned to address the diverse orthodontic needs of children and adult patients, from the basic to the most complex. She also gained experience in coordinating the multidisciplinary treatment of patients with craniofacial syndromes and skeletal discrepancies    She currently resides on the Upper East Side with her husband and two children.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Manhattan Eastside Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>Montefiore Medical Center, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>American Dental Association</li><li>New York State Dental Association</li><li>Omicron Kappa Upsilon Dental Honor Society</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.81, '2022-09-15'),
(62, 'Dr.  Miang Chneh (Christopher) Teo , DDS', 'Orthodontist', '76bc4a85c2db4b2a4bfa93761931b57aDr---Miang-Chneh-(Christopher)-Teo---DDS.png', '220 Madison Avenue, Suite A , New York , NY  10016', 'Dr. Teo was born and raised in Singapore, and he obtained his dental degree in 2004 from the University of Adelaide. After working as a general dentist for 8 years, he moved to New York to pursue his passion for orthodontics. He completed both international and postgraduate studies in Orthodontic and Dentofacial Orthopedic training in NYU and is a diplomate for the American Board of Orthodontics.    Dr. Teo’s treatment philosophy starts with understanding each and every individual patient’s goals and needs, and works hand-in-hand with them to establish and build a balanced, beautiful smile. Having worked as a general dentist prior to his orthodontic specialization, Dr. Teo has the benefit of a broader approach to his patients’ dental needs and enjoys multi-disciplinary cases which may involve working together with your primary dental care provider, as well as other specialists such as oral surgeons, prosthodontists and periodontists. Dr. Teo also has a particular interest in adult orthodontics, and has published research on accelerated orthodontics and adult orofacial orthopedics. He believes that orthodontics should be both esthetic and convenient; and thus is continuously finding ways to further optimize the use of clear aligner and Invisalign therapy.    Dr. Teo is board certified by the American Board of Orthodontics (ABO), the only orthodontic board certification that is recognized by the American Dental Association and American Association of Orthodontists, and is also an active member of the American Association of Orthodontists.    Outside of the office, Dr. Teo stays sporty and active, from boxing and tennis to yoga and Pilates. He enjoys traveling with his wife and his beloved rescue dog, from road trips to overseas adventures.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Simply Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>The University of Adelaide, Bachelor of Dental Surgery</li><li>New York University, Certificate in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Install Braces</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(63, 'Dr.  Inessa Kandov , DDS', 'Orthodontist', '559abe269565a26b8a632d81c4251216Dr---Inessa-Kandov---DDS.png', '213-33 39th Ave, Suite 300 , Queens , NY  11361', 'Dr. Inessa Kandov is a board-certified specialist in Orthodontics &amp; Dentofacial Orthopedics. She is a strong believer in treating patients like family and providing the highest quality care. Her welcoming smile and gentle demeanor create a truly caring and positive atmosphere for her patients. She takes pride in serving her community and has great satisfaction in creating beautiful smiles and healthy lives.    Raised in New York City, Dr. Kandov pursued her dental studies at the State University of New York at Stony Brook where she graduated Valedictorian with a Doctor of Dental Surgery degree. Dr. Kandov is a member of the prestigious Omicron Kappa Upsilon Honor Dental Society and is the recipient of multiple academic and clinical awards including the Alpha Omega International Dental Fraternity Academic Achievement Award.    Following a General Practice Residency at Queens Hospital Center, Dr. Kandov practiced as a general dentist for several years. She completed her Orthodontic residency at one of the top schools in the country, Montefiore Medical Center in the Bronx, where she earned her certificate in Orthodontics and Dentofacial Orthopedics.    Dr. Kandov seeks to have a positive impact on all of her patients. Conveniently located in Bayside, her office features the most updated technology available, including intraoral scanners and 3D x-rays. She offers cosmetic teeth-straightening options so that you can get the smile you deserve without having to worry about a mouthful of wires.    Today, she is recognized as an Invisalign Gold Provider and is an active member of the American Association of Orthodontists, American Dental Association, New York State Dental Association and The Northeastern Society of Orthodontists. She regularly attends continuing education seminars to learn about the newest advances in orthodontics.    Dr. Kandov lives in Queens, New York. When not creating beautiful smiles, she loves nothing more than to spend her free time with her husband, Lev, and two daughters, Ariella and Eliana.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Bayview Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - State University of New York, Stony Brook, Doctor of Dental Surgery</li><li>Montefiore Medical Center, Residency in Orthodontics</li><li>Montefiore Medical Center, Certificate in Orthodontics and Dentofacial Orthopedics</li><li>Queens Hospital Center, Residency in General Dentistry</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>Northeastern Society of Orthodontists</li><li>American Association of Orthodontists</li><li>New York State Dental Association</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces Consultation</li><li>Install Braces</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(64, 'Dr.  Robert Lopatkin , DDS', 'Orthodontist', '3d35c1c7d08fb85fa6906e2dec3d7bc3Dr---Robert-Lopatkin---DDS.png', '2312 31st Street , Astoria , NY  11105', 'Robert J. Lopatkin holds a Doctor of Dental Surgery (D.D.S.) degree from the State University of New York at Stony Brook. After completing a fellowship at Long Island Jewish Medical Center in New Hyde Park, he went on to specialize in orthodontics and dentofacial orthopedics at New York University. Dr. Lopatkin is a member of the American Dental Association, Queens Dental Society, American College Of Diplomates, the Long Island Academy of odontology and since 1988 has served as a Diplomate on the American Board Of Orthodontics. Dr. Lopatkin teaches at N.Y.U. School of Dentistry as a Clinical Associate Professor Orthodontics. A native New Yorker, Dr. Lopatkin lives on Long Island with his wife and two daughters.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Astoria Family Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - State University of New York, Stony Brook, Doctor of Dental Surgery</li><li>City University of New York, Queens College, (Bachelor’s)</li><li>Long Island Jewish Medical Center (Fellowship)</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.77, '2022-09-15'),
(65, 'Dr.  Gilda Duarte , DDS', '', '55febebe977648be4ad964ab6ccfd0caDr---Gilda-Duarte---DDS.png', '', '', 0.00, '2022-09-15'),
(66, 'Dr.  Joshua Rothenberg , DDS', 'Orthodontist', 'c2b1ab6033429fa92fc588fbe1257722Dr---Joshua-Rothenberg---DDS.png', '1025 Northern Blvd, Suite 2017 , Roslyn , NY  11576', 'Dr. Joshua Rothenberg is a graduate of Binghamton University. He received his doctorate of dental surgery and orthodontic training from New York University. Dr. Rothenberg is a member of the American Dental Association, The American Association of Orthodontists and is a diplomat of the American Board of Orthodontists.     Dr. Rothenberg is dedicated to maintaining a reputation of excellence in orthodontics and maxillofacial orthopedics and stays current in all the latest techniques. He has lectured on orthodontics and Invisalign. Dr. Rothenberg will be joining the staff at Mather-St Charles Hospital, dental department. Dr. Rothenberg lives with his wife, Abbie and sons Ethan and Zachary on Long Island.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>North Fork Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>New York University, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Dental Association</li><li>American Association of Orthodontists</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.65, '2022-09-15'),
(67, 'Dr.  Joana Forsea , DDS', 'Orthodontist', '8b07dd41f5b73279517655d24be839e9Dr---Joana-Forsea---DDS.png', '3 School St, Suite 202 , Glen Cove , NY  11542', 'Dr. Forsea has been practicing orthodontics for over 20 years in New York and abroad in Europe. Ever since her graduation from NYU College of Dentistry and her Orthodontic Residency Program there, she has remained as a faculty member to oversee and train rising orthodontists for the next generation. She has perfected her expertise in treating children, adolescents, and adults with CLIII malocclusions (underbites) in addition to all dentofacial anomalies and malocclusions.    Dr. Forsea cares deeply about her patients overall well-being and health. She views orthodontics from the broad sense of treating the entire patient. This includes looking at the function of the occlusion, the bite, the aesthetics of the smile and the psychological implications of the treatment the patients are undergoing. She understands that treatment is not easy for patients and she strives to create an orthodontic experience that is custom fit for every patient.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Glen Cove Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>New York University, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 0.00, '2022-09-15'),
(68, 'Dr.  Janine Ellis , DDS', 'Orthodontist', 'd8aff53982a3113e13c8c6ed373158f7Dr---Janine-Ellis---DDS.png', 'Great Neck Orthodontics PLLC1000 Northern Blvd, Suite 300 , Great Neck , NY  11021', 'I love orthodontics. I love that I have the ability to make someone want to smile. It’s a joy to witness the changes in each person’s smile, along with the transformations in their personality. Every patient changes and grows as they see their teeth straighten. They become more comfortable with their appearance and more confident in their interactions. I cannot help but feel fulfilled when someone who previously was ashamed of their teeth begins to smile and laugh without worry.    Working with so many different people is one of my favorite parts of the job. I spend my days talking with and getting to know fascinating people, and love the relationships that develop. Many of my patients become my friends. My job allows me to create healthy, beautiful smiles for people I care about. I can’t imagine doing anything else!    Each year I seek out continuing education (CE) courses on topics related to orthodontics and oral healthcare, including Invisalign®. This ensures I remain current on developments in the field, including new technologies and breakthroughs in treatment processes. My patients trust me to provide them with the highest level of care, and the widest range of proven treatments; CE courses ensure I am able to do so.    I’m a native of Toronto, Canada, but have called Great Neck, NY my home for over ten years. My husband and I have two wonderful sons, Ryan and Justin, and I am involved with many of their school and extracurricular activities. In addition to helping out at PTA events, I’m the parent coach for my boys’ soccer team.    My family is my priority and I spend as much time with them as I can. We love traveling and being together.    I’m also an avid reader and a board member of the Russell Gardens Association.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Douglas Palaganas DDS</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>State University of New York, Stony Brook, Residency in Orthodontics</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(69, 'Dr.  Douglas Palaganas , DDS', 'Orthodontist', '7839ed54b59bb62dc6e6adf15e00ae21Dr---Douglas-Palaganas---DDS.png', 'Great Neck Orthodontics PLLC1000 Northern Blvd, Suite 300 , Great Neck , NY  11021', 'We have built our practice around a unique practice vision.  Due to our economy, orthodontic practices all over our area have been focusing more on the “business” of orthodontics, rather than the “practice” of orthodontics.  Dr. Doug believes the focus of a truly successful practice needs to be on the patient.    Our focus is not only on personalized, state-of-the art orthodontic care, but also on providing a top notch patient/family experience.   This patient experience depends on Dr. Doug taking the time to get to know his patients and their families, so he can provide the appropriate, individualized care.  We want our patients to feel like part of our family.   This is not an “assembly-line” type practice where you see the assistants more than you see the doctor.    While Dr. Doug believes in cutting edge diagnostics and treatment; utilizing the lowest dose digital x-rays, no-radiation digital models and the most up to date treatment options, he also believes it is even more important to be readily available to all his patients at every visit, to discuss progress and answer any questions for patients and parents.   We strive to “be the best” for our patients, because Dr. Doug believes if we are successful at all the above, that our patients will not only refer others to us, but that they will be our biggest fans, and that they will go out of their way to tell their friends and family about our practice!    Our practices were established with the belief that if we are successful at staying committed to our vision, that the “business” of growing our practice will largely take care of itself, which allows us to continue to spend our time and efforts on our amazing patients and their care!<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Douglas Palaganas DDS</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - State University of New York, Stony Brook, Doctor of Dental Surgery</li><li>State University of New York, Stony Brook, Residency in Orthodontics</li><li>Cornell University (Bachelor’s)</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>American Dental Association</li><li>Northeastern Society of Orthodontists</li><li>Omicron Kappa Upsilon Dental Honor Society</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.97, '2022-09-15'),
(70, 'Dr.  Kristine M. Hyon , DMD, MS', 'Orthodontist', 'b694cd39849f8145405f35ffd274c405Dr---Kristine-M--Hyon---DMD--MS.png', '194 Livingston St, Suite 1 , Northvale , NJ  07647', 'Dr. Hyon graduated from University of Pennsylvania School of Dental Medicine.    She completed a year of general practice residency at the VA medical center in Philadelphia, PA.    She practiced general dentistry for 3 years in Philadelphia and in New Jersey before entering the orthodontic specialty residency at UMDNJ in 1997.    Dr. Hyon successfully completed the Orthodontic Residency Program and received an MS degree in Oral Biology in 2000. Her teaching experience as Associate Clinical Professor at UPenn as well as NYU dental school reflects her dedication to academic excellence and best quality care for her patients.    As a new office policy, there will be a consultation fee.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>KHL ORTHODONTICS LLC</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - University of Pennsylvania, Doctor of Dental Medicine</li><li>Philadelphia Veterans Affairs Medical Center, Residency in General Practice</li><li>University of Medicine and Dentistry of New Jersey, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Orthodontic Consultation</li><li>Pediatric Dentist Consultation</li><li>Temporo-Mandibular Joint (TMJ) Pain</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.67, '2022-09-15'),
(71, 'Dr.  Tasha W. Bolden , DMD, MSD', 'Orthodontist', 'fec1d9963c599d6f5dddb6cf86668f8cDr---Tasha-W--Bolden---DMD--MSD.png', '611 Nazareth Pike , Nazareth , PA  18064', 'Dr. Bolden has been trained in the most modern techniques in orthodontics, including, self ligating brackets (for faster treatment), Invisalign®, ceramic braces, and many others. Her philosophy centers around total dedication to individualized patient care. Dr. Bolden continues to attend continuing education lectures and meetings throughout the year to ensure she is providing the most up-to-date care for her patients.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Schoolhouse Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - University of Pennsylvania, Doctor of Dental Medicine</li><li>Case Western Reserve University, Residency in Orthodontics</li><li>Case Western Reserve University, Master’s in Dentistry</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Pediatric Dentist Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.91, '2022-09-15'),
(72, 'Dr.  Adam Shatz , DDS', 'Orthodontist', '432ae2da6ee80a6c318b817165c48fbaDr---Adam-Shatz---DDS.png', '3 School St, Suite 202 , Glen Cove , NY  11542', 'Dr. Adam D. Shatz has been a specialist in the field of orthodontics with over seventeen years of experience. He obtained his Doctorate of Dental Surgery and completed an Orthodontic Residency at the State University of New York at Stony Brook, School of Dental Medicine.    To keep up to date on the latest techniques and technology in orthodontics, Dr. Shatz holds memberships in many professional organizations, including the American Association of Orthodontists, the World Federation of Orthodontists, the Northeastern Society of Orthodontists, the Nassau County Dental Society, the American Dental Association, and the New York County Dental Society.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Glen Cove Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - State University of New York, Stony Brook, Doctor of Dental Surgery</li><li>State University of New York, Stony Brook, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>New York County Dental Society</li><li>American Dental Association</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 0.00, '2022-09-15'),
(73, 'Dr.  Sabeeh Khan , DDS', 'Orthodontist', '279e1209ec0b506f9a2706f6da863699Dr---Sabeeh-Khan---DDS.png', '500 North Broadway, suite 146 , Jericho , NY  11753', 'Dr. Khan has been providing outstanding orthodontic care since 1992. He earned his doctorate as well as his post doctorate specialty certificate in orthodontics from Columbia University.    During his orthodontic training, Dr. Khan had the distinct honor of having Prof. M.L. Moss (the former dean of Columbia Dental School and a leading authority of cranial facial growth and development) as his reseach mentor. To stay up-to-date on the latest advancements in the field of orthodontics, Dr. Khan maintains active membership in numerous prestigious professional organizations such as the American Dental Association, the American Association of Orthodontics, the North East Society of Orthodontics, the New York State Dental Association and the Nassau County Dental Society. Dr. Khan has also been inducted into Sigma XI, The Scientific Research Society. Outside the office, Dr. Khan enjoys traveling, playing tennis, running, cycling, photography and spending time with his family. He and his wife, Azita, also an orthodontist, met while attending Columbia University. Married in 1989, they now have three sons.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Khan Orthodontic Group</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>Columbia University, Certificate in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.67, '2022-09-15'),
(74, 'Dr.  Gregg Fader , DMD', 'Orthodontist', '59680c405534754a2e4e67158bb5142bDr---Gregg-Fader---DMD.png', '1075 Central Park Ave , Scarsdale , NY  10583', 'After owning orthodontic practices in Manhattan and Queens, Dr. Fader opened Ardsley Orthodontics in 1999.  He attended the University of Pennsylvania, receiving his D.M.D. and graduating with honors. He did his postgraduate orthodontic training at N.Y.U., where he also taught clinical and preclinical orthodontics.    He is an Ardsley resident, living there with his wife, two children and two dogs.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Ardsley Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - University of Pennsylvania, Doctor of Dental Medicine</li><li>New York University, Certificate in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>World Federation of Orthodontists</li><li>American Dental Association</li><li>New York State Dental Association</li><li>Ninth District Dental Association</li><li>Northeastern Society of Orthodontists</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Install Braces</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(75, 'Dr.  Ranu Sinha , DMD', 'Orthodontist', '504cec02727ae74c0a5fee51ffa2c58dDr---Ranu-Sinha---DMD.png', '850 Broad Street , Shrewsbury , NJ  07702', 'Dr. Sinha is a graduate of Barnard College, Columbia University where she graduated magna cum laude. She received her dental degree from Fairleigh Dickinson University, School of Dentistry and received a certificate in Graduate Studies in Orthodontics from Boston University, Henry M Goldman School of Dental Medicine. She has over 25 years of experience in creating beautiful smiles and is also an Invisalign® preferred provider. She loves developing relationships with her patients and is committed to providing excellent orthodontic results in adults as well as children in a relaxed and friendly environment. She is thrilled to have the privilege of playing a vital role in helping transform patients’ smiles, confidence and lives. Dr. Sinha resides in Edison, New Jersey. When she is not creating beautiful smiles she likes to spend time with her husband David and her two daughters Nina and Anjali. Dr Sinha enjoys exercising, gardening and playing with her dog Diesel.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Shrewsbury Dental Group</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Fairleigh Dickinson University, Doctor of Dental Medicine</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Dental Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(76, 'Dr.  Seth Margulies , DDS', 'Orthodontist', '690e43c254d9870b799c3652ed60597eDr---Seth-Margulies---DDS.png', '123 Green Street , Woodbridge , NJ  07095', '', 0.00, '2022-09-15'),
(77, 'Dr.  Jordan Lissauer , DMD', 'Orthodontist', 'da8c5adf76013d68a6aa6a3e2e6b820dDr---Jordan-Lissauer---DMD.png', '3767 Hylan Blvd , Staten Island , NY  10308', 'Dr. Jordan Lissauer grew up in sunny Florida. From a young age, he enjoyed hanging around his dad&#x27;s dental office a little too much. His first drawings were actually of cartoon teeth. He then needed braces, twice, and oddly enough loved the process so much that he decided to become an orthodontist.    He followed in his dad&#x27;s footsteps and attended Tufts Dental School, where he graduated Summa cum laude and was again honored as Valedictorian.    After graduating dental school, Dr. Lissauer decided to move from Boston to New York City. Within a few months, he met his wife Amy - a New Yorker (explaining why this Floridian settled down in the Northeast). In NYC, he continued his training as a general practice resident at Coler-Goldwater Hospital on Roosevelt Island and was appointed Chief Resident.    In 2013, he fulfilled his childhood dream and graduated from a three-year Orthodontic Residency program at Montefiore Medical Center in the Bronx. Soon thereafter, he became a Board Certified Diplomate of the American Board of Orthodontics.  Dr. Lissauer loves being an orthodontist more than he ever imagined and his expectations were pretty high. He enjoys the beautiful smiles but, even more, getting to know patients, families and the community.    Outside of the orthodontic office, Dr. Lissauer spends almost every moment with his wife and their two wonderful sons Cole and Jack. The Lissauer family loves to hike, ski, go to the beach, attend concerts, cheer on Michigan and travel - but mainly back to sunny Florida.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Brustein Lissauer Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Tufts University, Doctor of Dental Medicine</li><li>Montefiore Medical Center, Residency in Orthodontics</li><li>NYC Health + Hospitals/Coler, Residency in General Practice</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>Phi Kappa Phi Honor Society</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(78, 'Dr.  Alice Golden , DDS', 'Orthodontist', 'f5f9e7754d2153291d11eab4fa0abd52Dr---Alice-Golden---DDS.png', '3010 Amboy Rd, #2 , Staten Island , NY  10306', 'Dr. Alice Golden was raised in Long Island, New York. She graduated from NYU for her undergraduate degree and NYU College of Dentistry. Post graduation, she completed her general practice residency at Maimonides Medical Center and then went onto working as a private dentist in Manhattan. After working as a private dentist, she went on to continue her education and concluded her education at Maimonides Medical Center. Dr. Golden’s passion is to create beautiful and confident smiles in everyone. She is committed to ensure the highest quality of care to her patients and believes that everyone deserves a beautiful smile.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>iSmile Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>Maimonides Medical Center, Residency in General Practice</li><li>Maimonides Medical Center, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.84, '2022-09-15'),
(79, 'Dr.  Avijit Goel , DMD', 'Orthodontist', '69b666c9e0ec6a56f576ecf1e9929998Dr---Avijit-Goel---DMD.png', '369 Springfield Ave , Berkeley Heights , NJ  07922', 'Serving the communities of Berkeley Heights, NJ, Dr. Avijit Goel is an orthodontist and a periodontist. He currently works at Advanced Dental Specialists. Patients visit him for invisible braces, retainer installations, retainer removals, tooth extractions, and wisdom tooth problems.     Dr. Goel acquired his dental degree from the University of Pennsylvania. He then completed a residency in orthodontics and periodontics at the same institution. He ensures that all his patients receive complete and comprehensive care.     Dr. Goel is a member of the American Association of Orthodontists, American Academy of Periodontology, and the American Dental Association. For him, building and maintaining a partnership with all his patients is essential. He strives to make dental visits a low-stress experience with minimal discomfort.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Advanced Dental Specialists</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - University of Pennsylvania, Doctor of Dental Medicine</li><li>University of Pennsylvania, Residency in Orthodontics and Periodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>American Academy of Periodontology</li><li>American Dental Association</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Dental Consultation</li><li>Orthodontic Consultation</li><li>Periodontist Consultation</li><li>Tooth Extraction</li><li>Wisdom Tooth Problem</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 0.00, '2022-09-15');
INSERT INTO `orthodontrys` (`id`, `dr_name`, `specialty`, `image`, `location`, `discription`, `review_rate`, `created_at`) VALUES
(80, 'Dr.  Colleen Gordon , DMD, MS', 'Orthodontist', 'cdcb9fe45a88335bb358b508cc8a6146Dr---Colleen-Gordon---DMD--MS.png', '545 N Bethlehem Pike, Suite 205 , Ambler , PA  19002', 'Dr. Colleen Gordon is a dentist and an orthodontist. She received her dental degree from Temple University and pursued a master’s degree in orthodontics at Saint Louis University. She does her best to make sure that patient visits are comfortable and enjoyable.     Dr. Gordon sees patients at her practice in Ambler, PA, for orthodontal consultation, mouthguard, teeth grinding, gapped teeth, and abnormal tooth eruption. She is a member of the American Association of Orthodontists and the Middle Atlantic Society of Orthodontists.     Dr. Gordon provides sound advice and takes care of all her patient&#x27;s needs, and emphasizes preventive care for all. She recognizes that many patients may not be completely comfortable with visiting a dentist. Hence, she endeavors to make dental visits a low-stress experience with minimal discomfort.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Gordon Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Temple University, Doctor of Dental Medicine</li><li>Saint Louis University, Master&#x27;s in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>Middle Atlantic Society of Orthodontists</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces Consultation</li><li>Cross Bite</li><li>Gapped Teeth</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 0.00, '2022-09-15'),
(81, 'Dr.  David Coleman , DDS', 'Orthodontist', 'df89f439d54be4a3f208a91b7e2091adDr---David-Coleman---DDS.png', '375 South End Ave , New York , NY  10280', 'Dr. Coleman was born and raised in Kansas and received his dental degree from Columbia University College of Dental Medicine in New York. After dental school, he served for 4 years in the Air Force as a commissioned officer, working as a general dentist, dental lab director, and officer in charge of mass casualty response training. While in the Air Force, Dr. Coleman earned the rank of Captain, received the Air Force Commendation Medal, and was given the honor of being named Company Grade Officer of the Year for the medical group at Joint Base McGuire-Dix-Lakehurst, NJ.  Following his military service, he went on to earn his Certificate in Orthodontics and Dentofacial Orthopedics from NYU Langone Dental Medicine.     Dr. Coleman enjoys working with patients of all ages and is highly experienced in providing child, adolescent, and adult orthodontic treatment with braces and Invisalign. He continually seeks to expand his skillset with continuing education courses, including the Aligner Intensive Fellowship, a rigorous course focusing on clear aligner treatment.    Dr. Coleman’s Professional Training and Memberships    American Dental Association  American Association of Orthodontists  Northeastern Society of Orthodontists<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Battery Park Dental Group</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>NYU Langone Health, Certificate in Orthodontics and Dentofacial Orthopedics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Dental Consultation</li><li>Orthodontic Consultation</li><li>Pediatric Dentist Consultation</li><li>Temporo-Mandibular Joint (TMJ) Pain</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.93, '2022-09-15'),
(82, 'Dr.  Cristina Teixeira , DMD', 'Orthodontist', 'ea580f782bdd214ac264a633de35673eDr---Cristina-Teixeira---DMD.png', '79 Hudson St, Suite 400 , Hoboken , NJ  07030', 'Dr. Cristina Teixeira is Chair and Associate Professor in the Department of Orthodontics at New York University College of Dentistry. She graduated from the University of Pennsylvania, where she obtained her Dental Medicine Doctor’s Degree, a Masters Degree in Oral Biology, certificate in Orthodontics, and a Ph.D. in Developmental Biology.     Dr. Teixeira is a world-renowned expert in bone growth and tooth movement. She is regularly invited to speak at national and international conferences and universities around the world.  Her research has been supported by different foundations and by grants from the National Institute of Health.     Her approach for early interceptive orthodontic treatment takes advantage of the child growth and modifies it to correct jaw position and size, and allow permanent teeth to erupt well-aligned. This approach, inspired by Dr. Teixeira’s research, avoids tooth extractions and the need for braces in the majority of cases.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Orthodontia Studio</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - University of Pennsylvania, Doctor of Dental Medicine</li><li>University of Pennsylvania, Certificate in Orthodontics</li><li>Universidade do Porto, Doctor of Dental Surgery</li><li>University of Pennsylvania, Master&#x27;s in Oral Biology</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>American Association for Dental Research</li><li>International Association for Dental Research</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Oral Surgery Consultation</li><li>Orthodontic Consultation</li><li>Temporo-Mandibular Joint (TMJ) Pain</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(83, 'Dr.  Keith Dobrin , DMD', 'Orthodontist', '4591439c7c03607d889380d1bd76b83fDr---Keith-Dobrin---DMD.png', '17 Avenue D , New York , NY  10009', '', 0.00, '2022-09-15'),
(84, 'Dr.  Ryan Trulby , DDS', 'Orthodontist', '6a99a3c9f61cf4a70620c5f1c0d365efDr---Ryan-Trulby---DDS.png', '', 'Dr. Trulby completed his dental and orthodontics training at Columbia University just across the river, where he was chief resident and received awards for graduating at the top of his class.  Ryan continues to be involved at Columbia as an associate orthodontics faculty and secretary of the Columbia Orthodontics Alumni Society.    He’s completed several advanced training courses in Invisalign and a variety of additional topics, always aiming to learn something new every day.  Dr. Trulby has a lovely partner, Gabriella; is a devoted dog parent to his boxer, Niko.    When he’s not transforming smiles, he spends his downtime running the occasional marathon or reading a new book.  He also is (almost) fluent in Spanish and is a die-hard FC Barcelona fan—Visca Barça!<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Heights Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>Columbia University, Master&#x27;s in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.84, '2022-09-15'),
(85, 'Dr.  Elliott Moskowitz , DDS, MSD', 'Orthodontist', 'aa38dd48a605bec1fde23f017153fccbDr---Elliott-Moskowitz---DDS--MSD.png', '11 5th Avenue, Office C , New York , NY  10003', '$95 Consultation Fee - Out of Network Provider      Dr. Elliott Moskowitz has been providing high quality orthodontic treatment for many years. His orthodontic patients come from not only the Greenwich Village area, but from other areas in Manhattan and surrounding areas. He is an expert clinical orthodontist, clinical professor of orthodontics in the department of orthodontics at NYU College of Dentistry, author of over 100 orthodontic publications including chapters in orthodontic textbooks, Editor of respected orthodontic and dental journals, clinical researcher, and Board Certified by the American Board of Orthodontics. He has received many awards and honors. Dr. Moskowitz has trained hundreds of orthodontists at NYU College of Dentistry and other dental and orthodontic institutions nationally and internationally. It is not uncommon to find that many orthodontists practicing in Manhattan were trained by Dr. Moskowitz either in the University setting or in his office itself. NYU College of Dentistry is building a new orthodontic clinical facility in Dr. Moskowitz’s name.    Dr. Moskowitz received his dental degree and orthodontic training at NYU College of Dentistry in 1975 and also has received an M.S.D. degree which is an additional orthodontic degree that involved teaching and original research.    Dr. Moskowitz comes from a generational orthodontic family, dating back to 1937 when Dr. Hyman Moskowitz, his father started a practice. Dr. Elliott Moskowitz has been treating 2nd and 3rd generations of patients originally treated by Dr. Hyman Moskowitz and because of his reputation receives referrals from orthodontists who have patients who have relocated to NYC from all over the world.    An expert diagnostician, Dr. Moskowitz employs the most modern and up to date treatment methods rooted in years of clinical experience with children, teenagers, and adults.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Manhattan Family Orthodontics-Uptwn</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>New York University, Master&#x27;s in Dentistry</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces Consultation</li><li>Dental Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Temporo-Mandibular Joint (TMJ) Pain</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.93, '2022-09-15'),
(86, 'Dr.  Zubad Newaz , DDS', 'Orthodontist', '4bf407ed945d7adcd2ceff5b10e7baccDr---Zubad-Newaz---DDS.png', 'Team Dental NYC250 E 32nd St , New York , NY  10016', '', 0.00, '2022-09-15'),
(87, 'Dr.  Jacqueline Fulop-Goodling , DMD', 'Orthodontist', '4cdc27a41308b520e8306b4accdead60Dr---Jacqueline-Fulop-Goodling---DMD.png', '30 E 40th St , New York , NY  10016', 'Dr. Jacqueline Fulop-Goodling is a dentist. She runs her practice in New York, NY. She completed her Doctor of Dental Medicine degree and her residency in Orthodontics at Boston University.     Patients visit Dr. Fulop-Goodling for Invisalign consultations, retainer installation, braces, and dental cleaning. She also tends to patients with dental emergencies. Dr. Fulop-Goodling strives to keep herself updated with the advancements in dentistry and aims to provide suitable treatments to her patients.     Dr. Fulop-Goodling strongly believes that knowledge empowers patients. She educates them about the ways they can take care of their oral health.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Dr. Jacquie Smiles</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Boston University, Doctor of Dental Medicine</li><li>Boston University, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Dental Cleaning</li><li>Dental Consultation</li><li>Dental Emergency</li><li>New Patient Dental Exam (Adult)</li><li>Orthodontic Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 0.00, '2022-09-15'),
(88, 'Dr.  Craig Feldman , DMD', 'Orthodontist', 'be8d21756b24c2d222c653bc6fc899d4Dr---Craig-Feldman---DMD.png', '47-5 44th St, Suite A2 , Woodside , NY  11377', 'Dr. Craig Feldman has worked in private practice for over 15 years. He is an Elite Invisalign provider and current on the most modern orthodontic techniques. He has a special passion for working with children as well as treating complicated, multi-specialty adult orthodontic cases. Dr. Feldman’s strong diagnostic skills, coupled with his friendly, easy-going demeanor, enable him to provide his patients with the highest quality care and make the process both effective and fun.        In his spare time, Dr. Feldman loves doing yoga and traveling around the world.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>The Smilist Dental</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Tufts University, Doctor of Dental Medicine</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(89, 'Dr.  Elliott Moskowitz , DDS, MSD', 'Orthodontist', 'e30a6b24997d25102b57a8312a50084cDr---Elliott-Moskowitz---DDS--MSD.png', '133 East 58th Street, 9th Floor, Suite 912 , New York , NY  10022', '$95 Consultation Fee - Out of Network Provider      Dr. Elliott Moskowitz has been providing high quality orthodontic treatment for many years. His orthodontic patients come from not only the Greenwich Village area, but from other areas in Manhattan and surrounding areas. He is an expert clinical orthodontist, clinical professor of orthodontics in the department of orthodontics at NYU College of Dentistry, author of over 100 orthodontic publications including chapters in orthodontic textbooks, Editor of respected orthodontic and dental journals, clinical researcher, and Board Certified by the American Board of Orthodontics. He has received many awards and honors. Dr. Moskowitz has trained hundreds of orthodontists at NYU College of Dentistry and other dental and orthodontic institutions nationally and internationally. It is not uncommon to find that many orthodontists practicing in Manhattan were trained by Dr. Moskowitz either in the University setting or in his office itself. NYU College of Dentistry is building a new orthodontic clinical facility in Dr. Moskowitz’s name.    Dr. Moskowitz received his dental degree and orthodontic training at NYU College of Dentistry in 1975 and also has received an M.S.D. degree which is an additional orthodontic degree that involved teaching and original research.    Dr. Moskowitz comes from a generational orthodontic family, dating back to 1937 when Dr. Hyman Moskowitz, his father started a practice. Dr. Elliott Moskowitz has been treating 2nd and 3rd generations of patients originally treated by Dr. Hyman Moskowitz and because of his reputation receives referrals from orthodontists who have patients who have relocated to NYC from all over the world.    An expert diagnostician, Dr. Moskowitz employs the most modern and up to date treatment methods rooted in years of clinical experience with children, teenagers, and adults.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Manhattan Family Orthodontics-Uptwn</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>New York University, Master&#x27;s in Dentistry</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces Consultation</li><li>Dental Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Temporo-Mandibular Joint (TMJ) Pain</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.93, '2022-09-15'),
(90, 'Dr.  Lindsay B. Stearn , DDS', 'Orthodontist', 'dd0286336515ddd58c7d1972f4855ac3Dr---Lindsay-B--Stearn---DDS.png', 'Designer Braces Queens82-38 Kew Gardens Road , Kew Gardens , NY  11415', 'A free consultation is offered for Invisalign and Braces treatments ONLY. All other appointments (retainers etc.) will incur a standard consultation fee.  We do NOT repair permanent retainers. Also, please be aware that having orthodontics is not a given for dental insurances. Confirm that you have   A) Orthodontics in your dental plan.     B) Any age limitations for orthodontics(some plans only cover dependents up to X years of age, whether you have dependents or not)       C) The lifetime maximum for orthodontics.    Dr. Lindsay B. Stearn is a friendly and attentive orthodontist who prides herself on making patients of all ages feel comfortable and happy with their beautiful smiles. She brings the latest in techniques and training to her practice from New York University College of Dentistry and Montefiore Medical Center Department of Orthodontics.  Advanced techniques such as digital records (no more messy impressions), and digital radiographs are used for Invisalign and orthodontic cases.  In her state of the art practice these techniques are the norm.    	  In addition to treating patients with traditional metal and tooth colored braces, Dr. Stearn treats patients who need orthognathic surgery as well as those who desire Invisalign, Invisalign teen, and cosmetic Invisalign.  She is always happy to develop a treatment plan to fit your individual needs however small or large they may be.  	  When she is not working, Dr. Stearn enjoys traveling, exercising, and walking just about anywhere in NYC. So if you see her on the street, don’t forget to say hi!            Dr. Stearn is always accessible to her patients.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Stearn Orthodontics/Designer Braces</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>Montefiore Medical Center, Certificate in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>Northeastern Society of Orthodontists</li><li>Omicron Kappa Upsilon Dental Honor Society</li><li>New York State Dental Association</li><li>New York County Dental Society</li><li>American Dental Association</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces Consultation</li><li>Install Braces</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Teeth Whitening</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.81, '2022-09-15'),
(91, 'Dr.  Andres Gonzalez , DMD', 'Orthodontist', 'f3f141dccfc7a02eaeb01502c5bb9c65Dr---Andres-Gonzalez---DMD.png', '108-58 Queens Blvd , Forest Hills , NY  11375', 'Dr. Andres Gonzalez (Dr. G) was born in sunny Miami, Florida and moved to the northeast to attend Rutgers School of Dental Medicine where he received his Doctorate of Medicine in Dentistry and graduated with academic honors. After his dental school training, Dr. G completed a general practice residency at Wyckoff Heights Medical Center in Brooklyn and practiced as a general dentist for two years in New York City. He then decided to specialize in orthodontics and completed his postgraduate training at BronxCare Health Systems, where he received his specialty certificate in Orthodontics and Dentofacial Orthopedics. Dr. G loves his profession and strongly believes in the importance and impact a beautiful smile can have on an individual’s life. That being said, Dr. G enjoys interacting with all of his patients and is passionate about creating beautiful smiles for each and every one of them. Dr. G is Board Eligible by the American Board of Orthodontics, and is an active member of the American Association of Orthodontics, the American Dental Association, and the New York State Dental Association.    Dr. G currently lives in Brooklyn and during his free time he loves to explore new restaurants, cook, bake, travel, and play ball with his French bulldog, Marjorie.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Forest Hills Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Rutgers, The State University of New Jersey, Doctor of Dental Medicine</li><li>Wyckoff Heights Medical Center, Residency in General Practice Dentistry</li><li>BronxCare Health System, Certificate in Orthodontics and Dentofacial Orthopedics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontics</li><li>American Dental Association</li><li>New York State Dental Association</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Retainer Installation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.75, '2022-09-15'),
(92, 'Dr.  Junginn (Jessie) Choi , DDS, MS', 'Orthodontist', 'c0954c02a53b0bebbd6dc571086ee0a5Dr---Junginn-(Jessie)-Choi---DDS--MS.png', '261 E 78th St, 5th Floor , New York , NY  10075', 'Dr. Junginn (Jessie) Choi is a Board Certified Orthodontist (Diplomate of the American Board of Orthodontics) specializing in diagnosis, prevention and treatment of dental malocclusion and jaw alignment. An orthodontist is a specialist who undergoes additional training and education in the specific residency program, i.e. orthodontics, after graduating from dental school. Dr. Choi is familiar with various orthodontic techniques, including phase I treatment (e.g. expanders, space maintainers), traditional system, self-ligating system (e.g. Damon), and Invisalign treatment. She focuses on providing high quality of treatment and personalized care to each patient.    Dr. Choi attended Duke University in Durham, NC where she received the Bachelor of Science degree with major in Biological Anthropology and Anatomy and minor in Chemistry. She, then, pursued her professional career in dentistry at Columbia University College of Dental Medicine in New York, NY where she received the degree of Doctor of Dental Surgery. Upon graduation, she went straight onto the 3-year orthodontics residency program at the same institution, Columbia University, after which she obtained the Master of Science degree. Upon the completion of the residency, she has been working as an associate orthodontist at private offices in New Jersey.    Throughout her career, Dr. Choi’s main focus has been to be a competent dentist and to bring beautiful smiles to people. She feels fortunate to work in a profession in which she can witness how a transformation in one’s smile has a positive effect to her/his confidence and quality of life.    Dr. Choi currently resides in New York City. During her free time, she enjoys doing outdoor activities. She can be found running in Central Park, snowboarding, biking, or hiking.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Upper East Smiles</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>Columbia University, Master&#x27;s in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>College of Diplomates of the American Board of Orthodontics</li><li>Northeastern Society of Orthodontists</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Dental Consultation</li><li>Dental Follow Up</li><li>New Patient Dental Exam (Adult)</li><li>Orthodontic Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.84, '2022-09-15'),
(93, 'Dr.  Peter H. Chen , DDS, DMSc', 'Orthodontist', '57c687d4d75bee8086e0166c44ef100aDr---Peter-H--Chen---DDS--DMSc.png', '325 E 79th St, Unit 1B , New York , NY  10075', 'Peter H. Chen DDS, MBA, DMSc is a specialist in Orthodontics and Dentofacial Orthopedics with an outstanding academic resume and excellent clinical experience. He is a graduate of Harvard University, where he completed a rigorous four-year residency program in orthodontics. In addition to his clinical training, Dr. Chen also conducted numerous research projects, and concurrently received his Doctor of Medical Sciences (DMSc) degree from Harvard. In recognition of his work, Dr. Chen was awarded the prestigious Harvard Presidential Scholar Award.    In addition to private practice, Dr. Chen is a Clinical Instructor of Orthodontics at The Mount Sinai Hospital in New York City, where he teaches hospital residents and treats orthodontic and cleft lip/palate patients in the faculty practice. ?His vision is to provide a perfect smile and a healthy bite that is custom made for each patient, and his guiding principle is to treat each and every one of his patients like he would treat his own family.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Smile Up Dental</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - State University of New York, Stony Brook, Doctor of Dental Surgery</li><li>Harvard University, Doctor of Medical Science</li><li>Harvard University, Certificate in Orthodontics and Dentofacial Orthopedics</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(94, 'Dr.  Catherine Woo , DDS', 'Orthodontist', 'a6b7c2304bdd6dc3fcb151b66fac22baDr---Catherine-Woo---DDS.png', '87-34 Parsons Blvd , Jamaica , NY  11432', 'Dr. Woo is a Board Certified Orthodontist -- making her one of only a third of Orthodontists to receive this distinction. This additional certification, along with her extensive experience treating complex and surgical Invisalign and Orthodontic cases, ensures that she will be able to handle any of your concerns.    Dr. Woo earned her bachelor’s, master’s, and dental degrees from prestigious Columbia University. While at Columbia she was selected as one of 7 residents out of hundreds of applicants to the prestigious three year orthodontics program at Columbia University. She was trained in conventional straight wire, Invisalign, Damon, temporary anchorage devices (TADs), and multi-disciplinary techniques, among others. She has successfully treated a great variety of difficult cases, including severe open bites, crossbites, overbites, underbites, and surgical cases.    Dr. Woo, Diplomate of the American Board of Orthodontics, (the only orthodontic specialty board recognized by the American Dental Association and sponsored by the American Association of Orthodontists), is a member of the American Association of Orthodontics, American Dental Association, North Eastern Society of Orthodontics, and the Bronx County Dental Society. In her spare time, she loves to discover new restaurants, enjoys a good outdoor workout, and cooking up a good meal with friends and family.    Dr. Woo was raised in the suburbs of New Jersey and Taipei, Taiwan but moved to New York City for higher education. Consequently, Dr. Woo has always enjoyed diverse cultures and integrating with new people. This enjoyment translates everyday for the unique opportunities her patients present and allows her to find individualized and creative ways to help her patients achieve their goals.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Glen Oaks Dental Professionals</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>Columbia University, Master’s in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>Northeastern Society of Orthodontists</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Dental Consultation</li><li>Dental Follow Up</li><li>New Patient Dental Exam (Adult)</li><li>Orthodontic Consultation</li><li>Pediatric Dentist Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.84, '2022-09-15'),
(95, 'Dr.  Karin Grinbaum , DDS', 'Orthodontist', '0a570a5437c18975e2b456128a7916dbDr---Karin-Grinbaum---DDS.png', '160 E 88th St, Ste 1D , New York , NY  10128', 'Dr. Karin Grinbaum is a dedicated and patient-oriented orthodontist providing cutting-edge, innovative orthodontic care to her patients in New York City. Dr. Grinbaum studied orthodontics alongside the founder of hidden, or lingual, braces in Paris, France. She is certified by the American Board of Orthodontics and a member of the American Association of Orthodontists and the American Dental Association.   Dr. Grinbaum received her dental education from New York University College of Dentistry. She then attended the New York University College of Dentistry, where she received her doctor of dental surgery degree as well as her certificate of orthodontics. She treats patients with a variety of dental and orthodontic needs, and she provides services such as pediatric dental consultations, dental consultations, retainer installations, braces and retainer check-ups, InvisAlign consultations, and orthodontic consultations.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Grinbaum Orthodontics - Smiles+Grins</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>New York University (Residency)</li><li>New York University, Certificate in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces / Retainer Checkup</li><li>Braces Consultation</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Pediatric Dentist Consultation</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.92, '2022-09-15'),
(96, 'Dr.  George Pliakas , DDS, MS', 'Orthodontist', 'fcddd41573c380c55e2940e5dbfb7567Dr---George-Pliakas---DDS--MS.png', '271A Central Park West, (Entrance on W.87th St) , New York , NY  10024', 'If there are no openings on zocdoc, kindly call (212)362-4400 to schedule an appointment with Dr. Pliakas.  Dr.George Pliakas is a board-certified orthodontist committed to the highest level of care.  He has been creating beautiful smiles in the New York area for over a decade and truly loves what he does.  Be it with younger patients who are just growing into their smiles, or adults looking to transform theirs, &quot;Dr.George&quot; takes immense pride in his work.    He enjoys working in private practice and is currently President of the Orthodontic Alumni Society of Columbia University.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Central Park Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>Columbia University, Master’s in Orthodontics and Dentofacial Orthopedics</li><li>Harvard University (Bachelor’s)</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>College of Diplomates of the American Board of Orthodontics</li><li>American Association of Orthodontists</li><li>Northeastern Society of Orthodontists</li><li>American Dental Association</li><li>New York State Dental Association</li><li>New York County Dental Society</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Common visit reasons</h4><ul><li>Braces Consultation</li><li>Gapped Teeth</li><li>Invisible Braces / Invisalign Consultation</li><li>Orthodontic Consultation</li><li>Teeth Whitening</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.86, '2022-09-15'),
(97, 'Dr.  Emanuel Abayev , DDS', 'Orthodontist', '1287c5f758ba10fb2f222beb348160eaDr---Emanuel-Abayev---DDS.png', '79-14 164th St , Jamaica , NY  11432', 'Dr Emanuel Abayev is a Specialist in Orthodontics and Dentofacial Orthopedics. Growing up in Flushing Queens, Dr Abayev attended New York University College of Dentistry, one of the nations top dental schools, to receive his Doctor of Dental Surgery Degree. He graduated with honors and distinction and was inducted into Omicron Kappa Upsilon, the national dental honor society.    Dr Abayev then furthered his dental training by attending a one-year general practice residency at Kings County Hospital. He was then granted the opportunity to advance his training and education in the field of Orthodontics at the prestigious University of Pennsylvania Orthodontic Program. Dr Abayev excels in his profession by staying up to date with the latest orthodontic advances through his involvement with numerous profession organizations including the American Dental Association, American Association of Orthodontists, the Northeasthern Orthodontic Association, and the New York State Dental Association.    Dr. Abayev is committed to providing his patients with excellent comprehensive orthodontic care aided by advanced technology in a welcoming and friendly environment.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>My Smiles Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - New York University, Doctor of Dental Surgery</li><li>University of Pennsylvania, Certificate in Orthodontics</li><li>Kings County Hospital, Residency in General Practice</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Dental Association</li><li>American Association of Orthodontists</li><li>New York State Dental Association</li><li>Omicron Kappa Upsilon</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.89, '2022-09-15'),
(98, 'Dr.  Craig Feldman , DMD', 'Orthodontist', '1d1045b1bc94b70daa30baea72a3c2a0Dr---Craig-Feldman---DMD.png', '71 Lincoln Ave , Rockville Centre , NY  11570', 'Dr. Craig Feldman has worked in private practice for over 15 years. He is an Elite Invisalign provider and current on the most modern orthodontic techniques. He has a special passion for working with children as well as treating complicated, multi-specialty adult orthodontic cases. Dr. Feldman’s strong diagnostic skills, coupled with his friendly, easy-going demeanor, enable him to provide his patients with the highest quality care and make the process both effective and fun.        In his spare time, Dr. Feldman loves doing yoga and traveling around the world.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>The Smilist Dental</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Tufts University, Doctor of Dental Medicine</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(99, 'Dr.  Craig Feldman , DMD', 'Orthodontist', 'bbda511ace671232a0ab70f5dc85dc46Dr---Craig-Feldman---DMD.png', '133-36 Whitestone Expressway , Flushing , NY  11354', 'Dr. Craig Feldman has worked in private practice for over 15 years. He is an Elite Invisalign provider and current on the most modern orthodontic techniques. He has a special passion for working with children as well as treating complicated, multi-specialty adult orthodontic cases. Dr. Feldman’s strong diagnostic skills, coupled with his friendly, easy-going demeanor, enable him to provide his patients with the highest quality care and make the process both effective and fun.        In his spare time, Dr. Feldman loves doing yoga and traveling around the world.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>The Smilist Dental</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Tufts University, Doctor of Dental Medicine</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15');
INSERT INTO `orthodontrys` (`id`, `dr_name`, `specialty`, `image`, `location`, `discription`, `review_rate`, `created_at`) VALUES
(100, 'Dr.  Douglas Palaganas , DDS', 'Orthodontist', '8fc9a38c3a01e2bb9d07a54d20e15946Dr---Douglas-Palaganas---DDS.png', 'Dr. Doug Orthodontics PLLC77 North Centre Ave, Suite 306 , Rockville Centre , NY  11570', 'We have built our practice around a unique practice vision.  Due to our economy, orthodontic practices all over our area have been focusing more on the “business” of orthodontics, rather than the “practice” of orthodontics.  Dr. Doug believes the focus of a truly successful practice needs to be on the patient.    Our focus is not only on personalized, state-of-the art orthodontic care, but also on providing a top notch patient/family experience.   This patient experience depends on Dr. Doug taking the time to get to know his patients and their families, so he can provide the appropriate, individualized care.  We want our patients to feel like part of our family.   This is not an “assembly-line” type practice where you see the assistants more than you see the doctor.    While Dr. Doug believes in cutting edge diagnostics and treatment; utilizing the lowest dose digital x-rays, no-radiation digital models and the most up to date treatment options, he also believes it is even more important to be readily available to all his patients at every visit, to discuss progress and answer any questions for patients and parents.   We strive to “be the best” for our patients, because Dr. Doug believes if we are successful at all the above, that our patients will not only refer others to us, but that they will be our biggest fans, and that they will go out of their way to tell their friends and family about our practice!    Our practices were established with the belief that if we are successful at staying committed to our vision, that the “business” of growing our practice will largely take care of itself, which allows us to continue to spend our time and efforts on our amazing patients and their care!<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Douglas Palaganas DDS</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - State University of New York, Stony Brook, Doctor of Dental Surgery</li><li>State University of New York, Stony Brook, Residency in Orthodontics</li><li>Cornell University (Bachelor’s)</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>American Dental Association</li><li>Northeastern Society of Orthodontists</li><li>Omicron Kappa Upsilon Dental Honor Society</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 4.97, '2022-09-15'),
(101, 'Dr.  Nirav Patel , DMD', 'Orthodontist', 'd7e980f7803da2cb9b65190b5b1cbc47Dr---Nirav-Patel---DMD.png', '470 Clifton Ave , Clifton , NJ  07011', 'Dr. Patel is an orthodontist who was awarded his Doctor of Dental Medicine (DMD) degree from Boston University School of Dental Medicine. He completed his postgraduate residency training in Orthodontics specialty at Roseman University of Health Sciences.    Dr. Patel is an active member of American Association of Orthodontists (AAO), American Dental Association (ADA), New Jersey Dental Association (NJDA) to name a few.     Dr. Patel is committed to staying current on the latest advancements in orthodontics in order to provide the best possible care and treatment for his patients. Dr. Patel looks forward to helping his patients achieve smiles that will bring them confidence and happiness for a lifetime.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>The Smilist Dental</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Boston University, Doctor of Dental Medicine</li><li>Roseman University of Health Sciences, Residency in Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>American Dental Association</li><li>New Jersey Dental Association</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 0.00, '2022-09-15'),
(102, 'Dr.  Eleni Michailidis , DDS', 'Orthodontist', '1e39ee471a0c9c5690e1c5dc3f8a4086Dr---Eleni-Michailidis---DDS.png', '150-33 14th Ave, Suite 100 , Whitestone , NY  11357', 'With an extensive research and science background, Dr. Eleni Michailidis values the unique combination of art and science involved in orthodontics and in creating beautiful smiles.  She loves what she does and takes pride in making her patients’ orthodontic experience a pleasant and memorable one.  “Dr. Eleni” takes her time to get to know each and every one of her patients and considers them a part of her family.  With her specialized attention to detail, she customizes every smile to enhance its overall appearance and function.  In her free time, Dr. Eleni enjoys taking advantage of living in New York City.  She is a dancer and a member of a professional dance company for many years.  She loves to exercise and is a certified kickboxing instructor.  In addition, she loves to cook, read, travel, and spend time with her family.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Avenue Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li><li>Columbia University, Certificate in Orthodontics</li><li>Columbia University, Master&#x27;s in Orthodontics and Dentofacial Orthopedics</li><li>Columbia University, Master&#x27;s in Public Health</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>American Dental Association</li><li>New York Academy of Dentistry</li><li>New York State Dental Association</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15'),
(103, 'Dr.  Abraham Chahine , DDS', 'Orthodontist', 'acd9a3ca923307691e414380361b467fDr---Abraham-Chahine---DDS.png', '150-33 14th Ave, Suite 100 , Whitestone , NY  11357', 'For Dr. Abraham, building relationships with his patients makes the orthodontic experience more enjoyable and efficient. He is friendly, caring and compassionate. Dr. Abraham strongly believes in providing all of his patients with the most advanced options available. He does this by combining modern technology with a traditional, hands-on approach to orthodontics, ultimately giving his patients the best of both worlds. He is honored by the trust placed in him by his patients, who truly value his advice.<div data-test=\"children-wrap\" class=\"patient-web-app__sc-1xdyi0f-1 hZovOZ hidden\"><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Practice</h4><ul><li>Avenue Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Board certifications</h4><ul><li>American Board of Orthodontics</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Education</h4><ul><li>Dental School - Columbia University, Doctor of Dental Surgery</li></ul></div><div class=\"patient-web-app__sc-117blz5-0 lkNOSj\"><h4 class=\"patient-web-app__sc-117blz5-1 TPDPM\">Professional memberships</h4><ul><li>American Association of Orthodontists</li><li>New York State Dental Association</li><li>Northeastern Society of Orthodontists</li><li>American Dental Association</li></ul></div></div><span data-test=\"show-more-button\" class=\"patient-web-app__sc-1xdyi0f-2 dOdAzK hidden\"><span data-test=\"collapse-text\">... read more</span></span><span data-test=\"show-less-button\" class=\"patient-web-app__sc-1xdyi0f-2 patient-web-app__sc-1xdyi0f-3 dOdAzK hQNFmh hidden\"><span data-test=\"collapse-text\">... read less</span></span>', 5.00, '2022-09-15');
