(1, 13, 'Privacy policy', '<font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">Thank  you for choosing to be part of our community at (\"</font></font><strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">Company</font></font></strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">, </font></font><strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">we</font></font></strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">, </font></font><strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">us</font></font></strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">,  </font></font><strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">our</font></font></strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">\").  We are committed to protecting your personal information and your  right to privacy. If you have any questions or concerns about this  privacy notice or our practices with regard to your personal  information, please contact us at <a href=\"mailto:Info@maantheme.com\" target=\"_blank\">Info.@maantheme.com</a>&nbsp;.</font></font>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <br>    </p>  <p class=\"western\" style=\"margin-bottom: 0.2in; line-height: 150%\" align=\"left\">  <font color=\"#7f7f7f\"><font style=\"font-size: 11pt\" size=\"3\">This  privacy notice describes how we might use your information if you:</font></font></p>  <ul><li><p class=\"western\" style=\"line-height: 150%\" align=\"left\"><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">Download  	and use our mobile application — </font></font>  	</p>  </li></ul>  <ul><li><p class=\"western\" style=\"line-height: 150%\" align=\"left\"><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">Engage  	with us in other related ways ― including any sales, marketing, or  	events</font></font></p>  </li></ul>  <p class=\"western\" style=\"line-height: 150%\" align=\"left\"><font color=\"#7f7f7f\"><font style=\"font-size: 11pt\" size=\"3\">In  this privacy notice, if we refer to:</font></font></p>  <ul><li><p class=\"western\" style=\"line-height: 150%\" align=\"left\"><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">\"</font></font><strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">App</font></font></strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">,   	we are referring to any application of ours that references or links  	to this policy, including any listed above</font></font></p>  </li></ul>  <ul><li><p class=\"western\" style=\"line-height: 150%\" align=\"left\"><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">\"</font></font><strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">Services</font></font></strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">,   	we are referring to our</font></font><font color=\"#7f7f7f\">&nbsp;</font><font color=\"#7f7f7f\"><font style=\"font-size: 11pt\" size=\"3\">App,</font></font><font color=\"#7f7f7f\">&nbsp;</font><font color=\"#7f7f7f\"><font style=\"font-size: 11pt\" size=\"3\">and  	other related services, including any sales, marketing, or events</font></font></p>  </li></ul>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <font color=\"#7f7f7f\"><font style=\"font-size: 11pt\" size=\"3\">The  purpose of this privacy notice is to explain to you in the clearest  way possible what information we collect, how we use it, and what  rights you have in relation to it. If there are any terms in this  privacy notice that you do not agree with, please discontinue use of  our Services immediately.</font></font></p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <br>    </p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">Please  read this privacy notice carefully, as it will help you understand  what we do with the information that we collect.</font></font></strong></p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <br>    </p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <strong><font color=\"#000000\"><font style=\"font-size: 11pt\" size=\"3\">TABLE  OF CONTENTS</font></font></strong></p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <br>    </p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">1.  WHAT INFORMATION DO WE COLLECT?</font></font></p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">2.  HOW DO WE USE YOUR INFORMATION?</font></font></p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">3.  WILL YOUR INFORMATION BE SHARED WITH ANYONE?</font></font></p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">4.  DO WE USE COOKIES AND OTHER TRACKING TECHNOLOGIES?</font></font></p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">5.  HOW DO WE HANDLE YOUR SOCIAL LOGINS?</font></font></p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">6.  WHAT IS OUR STANCE ON THIRD-PARTY WEBSITES?</font></font></p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">7.  HOW LONG DO WE KEEP YOUR INFORMATION?</font></font></p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">8.  WHAT ARE YOUR PRIVACY RIGHTS?</font></font></p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">9.  CONTROLS FOR DO-NOT-TRACK FEATURES</font></font></p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">10.  DO CALIFORNIA RESIDENTS HAVE SPECIFIC PRIVACY RIGHTS?</font></font></p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">11.  DO WE MAKE UPDATES TO THIS NOTICE?</font></font></p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">12.  HOW CAN YOU CONTACT US ABOUT THIS NOTICE?</font></font></p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <font color=\"#595959\">13.  HOW CAN YOU REVIEW, UPDATE OR DELETE THE DATA WE COLLECT FROM YOU?</font></p>  <p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  <br>    </p>  <div id=\"TextSection\" dir=\"ltr\"><p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<strong><font color=\"#000000\"><font style=\"font-size: 11pt\" size=\"3\">1.  	WHAT INFORMATION DO WE COLLECT?</font></font></strong></p>  </div>  <div id=\"Section1\" dir=\"ltr\"><p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<br>    	</p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<strong><font color=\"#000000\"><font style=\"font-size: 11pt\" size=\"3\">Personal  	information you disclose to us</font></font></strong></p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<br>    	</p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<em><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">In  	Short:&nbsp;&nbsp;We collect personal information that you provide  	to us.</font></font></em></p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<br>    	</p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">We  	collect personal information that you voluntarily provide to us when  	you register on the&nbsp;App,&nbsp;express an interest in obtaining  	information about us or our products and Services, when you  	participate in activities on the App&nbsp;or otherwise when you  	contact us.</font></font></p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<br>    	</p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">The  	personal information that we collect depends on the context of your  	interactions with us and the App, the choices you make and the  	products and features you use. The personal information we collect  	may include the following:</font></font></p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<br>    	</p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">Personal  	Information Provided by You.</font></font></strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">  	We collect ;&nbsp;;&nbsp;;&nbsp;;&nbsp;;&nbsp;;&nbsp;;&nbsp;;&nbsp;and  	other similar information.</font></font></p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<br>    	</p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">Payment  	Data.</font></font></strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">  	We may collect data necessary to process your payment if you make  	purchases, such as your payment instrument number (such as a credit  	card number), and the security code associated with your payment  	instrument. All payment data is stored by . You may find their  	privacy notice link(s) here:  	<a href=\"https://www.sslcommerz.com/privacy-policy/\" target=\"_blank\">https://www.sslcommerz.com/privacy-policy/</a>.</font></font></p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<br>    	</p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">Social  	Media Login Data.&nbsp;</font></font></strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">We  	may provide you with the option to register with us using your  	existing social media account details, like your Facebook, Twitter  	or other social media account. If you choose to register in this  	way, we will collect the information described in the section called  	\"HOW  	DO WE HANDLE YOUR SOCIAL LOGINS?\" below.</font></font></p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<br>    	</p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">All  	personal information that you provide to us must be true, complete  	and accurate, and you must notify us of any changes to such personal  	information.</font></font></p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<br>    	</p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<strong><font color=\"#000000\"><font style=\"font-size: 11pt\" size=\"3\">Information  	automatically collected</font></font></strong></p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<br>    	</p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<em><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">In  	Short:&nbsp;&nbsp;Some information — such as your Internet  	Protocol (IP) address and/or browser and device characteristics —  	is collected automatically when you visit our App.</font></font></em></p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<br>    	</p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">We  	automatically collect certain information when you visit, use or  	navigate the App. This information does not reveal your specific  	identity (like your name or contact information) but may include  	device and usage information, such as your IP address, browser and  	device characteristics, operating system, language preferences,  	referring URLs, device name, country, location, information about  	how and when you use our App and other technical information. This  	information is primarily needed to maintain the security and  	operation of our App, and for our internal analytics and reporting  	purposes.</font></font></p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<br>    	</p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">Like  	many businesses, we also collect information through cookies and  	similar technologies. </font></font>  	</p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<br>    	</p>  	<p class=\"western\" style=\"line-height: 150%\" align=\"left\"><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">The  	information we collect includes:</font></font></p>  	<ul><li><p class=\"western\" style=\"line-height: 150%\" align=\"left\"><em><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">Log  		and Usage Data.</font></font></em><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">  		Log and usage data is service-related, diagnostic, usage and  		performance information our servers automatically collect when you  		access or use our App and which we record in log files. Depending  		on how you interact with us, this log data may include your IP  		address, device information, browser type and settings and  		information about your activity in the App&nbsp;(such as the  		date/time stamps associated with your usage, pages and files  		viewed, searches and other actions you take such as which features  		you use), device event information (such as system activity, error  		reports (sometimes called \'crash dumps\') and hardware settings).</font></font></p>  	</li></ul>  	<ul><li><p class=\"western\" style=\"line-height: 150%\" align=\"left\"><em><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">Device  		Data.</font></font></em><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">  		We collect device data such as information about your computer,  		phone, tablet or other device you use to access the App. Depending  		on the device used, this device data may include information such  		as your IP address (or proxy server), device and application  		identification numbers, location, browser type, hardware model  		Internet service provider and/or mobile carrier, operating system  		and system configuration information.</font></font></p>  	</li></ul>  	<ul><li><p class=\"western\" style=\"line-height: 150%\" align=\"left\"><em><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">Location  		Data.</font></font></em><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">  		We collect location data such as information about your device\'s  		location, which can be either precise or imprecise. How much  		information we collect depends on the type and settings of the  		device you use to access the App. For example, we may use GPS and  		other technologies to collect geolocation data that tells us your  		current location (based on your IP address). You can opt out of  		allowing us to collect this information either by refusing access  		to the information or by disabling your Location setting on your  		device. Note however, if you choose to opt out, you may not be able  		to use certain aspects of the Services.</font></font></p>  	</li></ul>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<br>    	</p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<strong><font color=\"#000000\"><font style=\"font-size: 11pt\" size=\"3\">Information  	collected through our App</font></font></strong></p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<br>    	</p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<em><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">In  	Short:&nbsp;&nbsp;We collect information regarding your geolocation,  	mobile device, push notifications, when you use our App.</font></font></em></p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\"> 