lment of our contract with  	you, compliance with our legal obligations, and/or your consent.</font></font></em></p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<br>    	</p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">We use  	personal information collected via our App for a variety of business  	purposes described below. We process your personal information for  	these purposes in reliance on our legitimate business interests, in  	order to enter into or perform a contract with you, with your  	consent, and/or for compliance with our legal obligations. We  	indicate the specific processing grounds we rely on next to each  	purpose listed below.</font></font></p>  	<p class=\"western\" style=\"margin-bottom: 0in; line-height: 150%\" align=\"left\">  	<br>    	</p>  	<p class=\"western\" style=\"line-height: 150%\" align=\"left\"><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">We  	use the information we collect or receive:</font></font></p>  	<ul><li><p class=\"western\" style=\"line-height: 150%\" align=\"left\"><strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">To  		facilitate account creation and logon process.</font></font></strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">  		If you choose to link your account with us to a third-party account  		(such as your Google or Facebook account), we use the information  		you allowed us to collect from those third parties to facilitate  		account creation and logon process for the performance of the  		contract.&nbsp;See the section below headed \"HOW  		DO WE HANDLE YOUR SOCIAL LOGINS?\" for further information.</font></font></p>  	</li></ul>  	<ul><li><p class=\"western\" style=\"line-height: 150%\" align=\"left\"><strong><font color=\"#595959\"><font style=\"font-size: 11pt\" size=\"3\">To  		p