(3, 3, 7, 14, 'womens T-shirt', 'Piece', '', 10, NULL, 'MS00002', 0, NULL, 1500, 1100, 1200, 300, 100, 120, '<div class=\\\"h-margin-v-default\\\" data-test=\\\"item-details-description\\\" style=\\\"box-sizing: inherit; outline: 0px; margin-top: 16px !important; margin-bottom: 16px !important; color: rgb[51, 51, 51]; font-family: Targetica, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb[255, 255, 255]; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\\\">&nbsp;This short-sleeve T-shirt makes a versatile choice in your basics wardrobe<br>and can be styled in a variety of ways. It features a crookneck for classic style and a solid white color for effortless casual styling. <br>The regular-fit top is made from soft and breathable fabric to ensure cool comfort<br>and it has a pullover design for easy wear. Style with ankle trousers, distressed jeans or shorts to create a number of looks you\'ll love.</div>', NULL, 'womens', NULL, NULL, 'womens-T-shirt', 18, 1, 2, '2021-11-25 05:45:05', '2022-03-08 13:03:02', NULL),
