(80, 3, 28, NULL, 'Projector', 'Piece', '', 10, NULL, 'MS00080', 0, NULL, 50000, 45000, 45000, 5000, 50, 100, '<ul><li>The mini home projector allows you to experience the feeling of a movie theater at home, suitable for sharing with family and friends.<br>1. Connectable devices: The projector has a rich and complete extension interface, can connect headphones, computer, set-top box, audio, DVD, U disk and other playback equipment.<br>2. Screen mirroring: Support wifi wireless/wired with the same screen, for Android and IOS devices, mobile screen seconds larger screen.<br>3. Portable theater: It can be projected everywhere. Go out camping, traveling, dating to show the most beautiful time.<br>4. LED environmental protection light source: diffuse reflection imaging principle, the light source time is 20,000 hours.<br>5. Picture quality: The design is precise, the picture quality is clear and sharp, and the picture is free from virtual focus and image distortion.<br>6. Built-in composite diaphragm speaker: The projector has a built-in independent cavity speaker.<br></li></ul>', NULL, 'Projector', NULL, NULL, 'Projector', 7, 1, 2, '2022-02-03 05:26:58', '2022-03-08 12:58:07', NULL),
