(83, 3, 30, NULL, 'DSLR Eos Camera', 'Piece', '', 10, NULL, 'MS00083', 0, NULL, 70000, 65000, 65000, 5000, 10, 100, '<p><span style=\\\"color: rgb[0, 0, 0]; font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 15px; text-align: justify;\\\">Feature Guide gives a simple description of each feature. This description is displayed in each shooting mode and when a function is selected. You can even disable the feature guide. By just clicking the Live View button, you can capture Full HD videos in different sizes and frame rates. It also has various features for in-camera editing. You can choose from about 60 compatible lenses to spruce up your videos. Capture up to 3 frames of those fast-moving objects in a second. This camera starts up instantly and features a speedy Autofocus, so you don\'t miss out on any action. With the Food Mode, you can click rich pictures of your food for your Instagram handle. You can even access features of Basic+ with the Quick Control Screen to change picture settings.</span><br></p>', NULL, 'DSLR-Eos-Camera', NULL, NULL, 'DSLR-Eos-Camera', 4, 1, 2, '2022-02-03 06:43:56', '2022-03-08 12:49:44', NULL),
