(105, 3, 73, NULL, 'Lemon Repel', 'Piece', '', 10, NULL, 'MS00102', 0, NULL, 5000, 4000, 4900, 100, 10, 50, '<ul style=\\\"box-sizing: inherit; padding-left: 16px; color: rgba[0, 0, 0, 0.87]; font-family: Lato, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb[255, 255, 255]; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\\\"><li style=\\\"box-sizing: inherit;\\\"><br></li><li style=\\\"box-sizing: inherit;\\\">MADE WITH OIL OF LEMON EUCALYPTUS: This DEET-free insect repellent provides you with protection during adventures in the backyard and on the go. REPELS MOSQUITOES FOR UP TO 6 HOURS: This repellent keeps you and your family protected for hours, so the fun doesn\'t have to end.<br>REFRESHING SCENT: This DEET-free personal repellent leaves you with a cool, refreshing scent so you don\'t have to put up with the usual bug spray smell. REPELS: Create a barrier against mosquitoes, including those that may transmit the Zika, West Nile, Dengue and Chikungunya viruses. NOT GREASY OR STICKY: Formulated with oil of lemon eucalyptus to provide protection without leaving your skin feeling sticky or greasy..</li></ul>', NULL, 'Lemon-Repel-', NULL, NULL, 'Lemon-Repel', 3, 1, 2, '2022-02-05 10:20:43', '2022-03-08 12:55:39', NULL),
(106, 3, 72, NULL, 'Flower Pot', 'Piece', '', 10, NULL, 'MS00105', 0, NULL, 400, 350, 350, 50, 20, 50, '<p><span style=\\\"color: rgba[0, 0, 0, 0.87]; font-family: Lato, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb[255, 255, 255]; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\\\">Perfect for indoor and outdoor container plants. Drainage Hole Design &amp; Removable Plant Saucer - Each planter has a drain hole at the bottom to let excess water flow out and keep the soil aerated and ventilated, to help prolong the life of your precious plants. And the detachable trays are provided to catch excess water.<br> Nothing to worry about water leaking out and damaging your floors. Great for indoor use.Premium Eco-Friendly Material - Made of thick and super sturdy plastic material, our flower nursery pots are lightweight, durable, and hard to break. <br>This cute planter pot will be a safe place for all of your lovely plants and it can be safely placed on the windowsill without worrying about falling or breaking. Perfect for Macrame Plant Hangers - A stunning addition to your indoor or outdoor garden. Perfect for hanging up with macrame plant hangers, or decorating your windowsill, desktop, shelf, bedroom, living room, kitchen, garden, office, etc.</span></p>', NULL, 'Flower-Pot-', NULL, NULL, 'Flower-Pot', 3, 1, 2, '2022-02-05 10:30:45', '2022-03-08 12:53:32', NULL),
