(262, 1, 309, NULL, 'School Software', 'Piece', '', 10, NULL, 'MS00247', 0, NULL, 200000, 150000, 150000, 50000, 20, 300, '<ul><li>Software is a collection of instructions that tell a computer how to work.This is in contrast to hardware, from which the system is built and actually performs the work.<br><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; At the lowest programming level, executable code consists of machine language instructions supported by an individual processor—typically a central processing unit [CPU] or a graphics processing unit [GPU]. Machine language consists of groups of binary values signifying processor instructions that change the state of the computer from its preceding state. For example, an instruction may change the value stored in a particular storage location in the computer—an effect that is not directly observable to the user. An instruction may also invoke one of many input or output operations, for example displaying some text on a computer screen; causing state changes which should be visible to the user. The processor executes the instructions in the order they are provided, unless it is instructed to \\\"jump\\\" to a different instruction, or is interrupted by the operating system.<br></li></ul>', NULL, 'School-Software-', NULL, NULL, 'School-Software-', 4, 1, 2, '2022-02-09 05:38:12', '2022-03-08 12:58:39', NULL),
