(291, 1, 15, NULL, 'Hiking Shoe', 'Piece', '', 10, NULL, 'MS00289', 0, NULL, 2500, 2300, 2300, 200, 20, 100, '<ul><li>Many of the On shoes below have been through our extensive testing process. That means getting each model on the feet of our team of over 350 avid runners, who then put at least 100 miles on the shoe before providing their feedback. As our test team and staff report their on-foot impressions, we also run a battery of mechanical tests in our RW Shoe Lab, where we measure everything from the energy return of On’s Speedboard midsoles to the softness of its Helion foam. <br></li></ul>', NULL, 'Hiking-Shoe', NULL, NULL, 'Hiking-Shoe', 4, 1, 2, '2022-02-19 05:31:18', '2022-03-08 12:54:23', NULL),
(292, 3, 14, NULL, 'cardiovascular Machines', 'Piece', '', 10, NULL, 'MS00292', 0, NULL, 14000, 13000, 12000, 2000, 50, 100, '<ul><li>Cardio does not have to be boring or monotonous, and these cardio machines will prove it. Here are 10 of the best cardio machines, according to certified trainers.As for how much and how often you should be doing cardio, you should try to aim to do three to four cardio workouts at week, each time for 30 minutes to an hour, says Kanski. \\\"Our bodies are extremely adaptive and can lose progress very quickly, so it’s important to stay consistent. The more we are over time, the better the results and improved endurance.<br></li></ul>', NULL, 'cardiovascular-Machines', NULL, NULL, 'cardiovascular-Machines', 5, 1, 2, '2022-02-19 07:10:07', '2022-03-08 13:02:23', NULL),
(293, 3, 14, NULL, 'Dumbbells', 'Piece', '', 10, NULL, 'MS00292', 0, NULL, 5800, 5000, 5000, 800, 50, 100, '<ul><li>The Marble Dumbbell is the most stylish of all Gym accessories. They are also perfect for use as a paper weight or functional sculpture in the home or studio.The marble dumbbells give an elegant style when exercising. We also love not having to store them and use them as decorative items or functional sculptures .Keeping the diverse requirements of customers in mind, we are instrumental in providing Iron Dumbbell. These products are stringently examined on numerous quality parameters before final dispatch. These products are known for their remarkable quality and finish.<br></li></ul>', NULL, 'Dumbbells-', NULL, NULL, 'Dumbbells', 5, 1, 2, '2022-02-19 07:17:57', '2022-03-08 12:51:34', NULL),
(294, 1, 14, NULL, 'Weight Lifting', 'Piece', '', 10, NULL, 'MS00292', 0, NULL, 5000, 4500, 4500, 500, 20, 100, '<ul><li>Olympic weightlifting, a sport of lifting a weighted barbell over the head, using the snatch and clean-and-jerk styles of lifts; officially called \\\"weightlifting\\\"<br>Powerlifting, a sport consisting of three types of barbell lift: the squat, bench press, and deadlift<br>Weight training, strength training through the use of weights<br>Weightlifting [album], by The Trash Can Sinatras<br></li></ul>', NULL, 'Weight-Lifting', NULL, NULL, 'Weight-Lifting', 4, 1, 2, '2022-02-19 07:22:33', '2022-03-08 13:01:45', NULL),
(295, 3, 14, NULL, 'Upright Bike', 'Piece', '', 10, NULL, 'MS00295', 0, NULL, 1500, 1200, 1200, 300, 100, 100, '<ul><li>Upright Bike was specifically engineered for the commercial environment, from its heavy-duty steel frame to its durable powder coat paint finish. Features like built-in hand pulse sensors on the multi-position handlebars, as well as the easy-to-read console with a variety builtin programs, satisfy casual and committed users alike. The extra-smooth ride comes from the perfected gearing and the integrated generator/flywheel system.<br></li></ul>', NULL, 'Upright-Bike', NULL, NULL, 'Upright-Bike', 4, 1, 2, '2022-02-19 07:24:57', '2022-03-08 13:00:55', NULL),
(296, 1, 14, NULL, 'Steel Weight lifting', 'Piece', '', 10, NULL, 'MS00296', 0, NULL, 2500, 2400, 2400, 100, 20, 100, '<ul><li>Good quality and low price: Our mold uses advanced technology and uses high-quality silicon, durable and has a high cost performance. Easy to use: You only need to put any elements you like into the silicone resin mold, such as the gold foil, put it into the mold and wait for a moment to cure, you can easily take it out and decorate it according to your preferences.<br>Environmentally friendly and reusable: Because of its unique material, it can be reused many times. After use, wash and dry the mold, and then it can be used next time.Wide Application: You can use it to decorate keychains and make jewelry, or you can use it to make home decorations. Easy demolding: This mold is made of silicone material, which is very convenient for demolding.<br></li></ul>', NULL, 'Steel-Weight-lifting', NULL, NULL, 'Steel-Weight-lifting', 4, 1, 2, '2022-02-19 07:27:22', '2022-03-08 12:59:48', NULL);
