(298, 1, 14, NULL, 'Rowing Machine', 'Piece', '', 10, NULL, 'MS00296', 0, NULL, 6000, 5500, 5500, 500, 25, 100, 'The rower is basically the horizontal version of the deadlift and uses similar muscles,\\\" says Creighton. \\\"On the drive, the main focus is on The rower is basically the horizontal version of the deadlift and uses similar muscles,\\\" says Creighton. \\\"On the drive, the main focus is on the posterior chain—the hamstrings, glutes, calves, and spinal erectors are all being used. In the pull, the quads, forearms, biceps, and lats are used as well.&nbsp;&nbsp;&nbsp; <br>', NULL, 'Rowing-Machine', NULL, NULL, 'Rowing-Machine', 4, 1, 2, '2022-02-19 07:30:41', '2022-03-08 12:58:31', NULL),
