(300, 5, 14, NULL, 'Elliptical machine', 'Piece', '', 10, NULL, 'MS00296', 0, NULL, 9000, 8000, 8000, 1000, 50, 30, '<ul><li>An elliptical trainer or cross-trainer is a stationary exercise machine used to stair climb, walk, or run without causing excessive pressure to the joints, hence decreasing the risk of impact injuries.[citation needed] For this reason, people with some injuries can use an elliptical to stay fit, as the low impact affects them little. Elliptical trainers offer a non-impact cardiovascular workout that can vary from light to high intensity based on the speed of the exercise and the resistance preference set by the user.<br></li></ul>', NULL, 'Elliptical-machine', NULL, NULL, 'Elliptical-machine', 4, 1, 2, '2022-02-19 07:35:05', '2022-03-08 12:52:51', NULL),
(301, 5, 14, NULL, 'Hack squat machine', 'Piece', '', 10, NULL, 'MS00296', 0, NULL, 3800, 2600, 3600, 200, 50, 100, '<p><span style=\\\"color: rgb[32, 33, 36]; font-family: arial, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb[255, 255, 255]; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\\\">Step into the machine, placing your feet shoulder-width apart and your shoulders and back against the pads. Release the safety handles, inhale, and lower down, bending your knees until they reach a 90-degree angle. Pause here, then push up through the back of your feet to extend your legs back to the starting position.</span></p>', NULL, 'Hack-squat-machine', NULL, NULL, 'Hack-squat-machine', 4, 1, 2, '2022-02-19 07:37:19', '2022-03-07 20:46:34', NULL),
